(1, 'help', ' readme  id readmetxt v 112122 20091125 154900 davereid exp contents of this file introduction installation frequently asked questions faq known issues how can you contribute introduction creator jacobsingh comaintainer bevan comaintainer dave reid this module is a little helper to maintain an administrator role which has all available permissions by default drupal only has one super user and this module helps improve this drastically note the updatephp will still only work for the real admin user 1 installation see http drupalorg gettingstarted installcontrib for instructions on how to install or update drupal modules if you don t already have an existing role named admin or administrator the module will automatically create one for you on install otherwise you can go to your admin users user settings admin user settings page and select your preferred admin role under the administrator role fieldset now when you add a new module your assigned role will automatically receive any new available permissions known issues there are no known issues at this time how can you contribute write a review for this module at drupalmodulescom http drupalmodulescom module adminrole help translate this module http localizedrupalorg translate projects adminrole report any bugs feature requests etc in the issue tracker http drupalorg project issues adminrole  ', 0),
(2, 'help', ' readme  id readmetxt v 12028 20090116 203926 sun exp summary the drupal administration menu module displays the entire administrative menu tree and most local tasks in a dropdown menu providing administrators one or twoclick access to most pages other modules may also add menu links to administration menu using hookadminmenu for a full description of the module visit the project page http drupalorg project adminmenu to submit bug reports and feature suggestions or to track changes http drupalorg project issues adminmenu requirements none installation install as usual see http drupalorg node 70151 for further information configuration configure user permissions in administer user management permissions adminmenu module access administration menu users in roles with the access administration menu permission will see the administration menu at the top of each page display drupal links users in roles with the display drupal links permission will receive links to drupalorg issue queues for all enabled contributed modules the issue queue links appear under the administration menu icon note that the menu items displayed in the administration menu depend on the actual permissions of the viewing user for example the user management menu item is not displayed to a user who is not a member of a role with the administer permissions and administer users permissions customize the menu settings in administer site configuration administration menu to prevent administrative menu items from appearing twice you may hide the navigation menu block or move the administer menu items into a separate menu customization to override the default administration menu icon you may 1 disable it via css in your theme body adminmenuicon display none 2 alter the image by overriding the theme function copy the entire themeadminmenuicon function into your templatephp rename it to phptemplateadminmenuicon or themenameadminmenuicon and customize the output according to your needs remember that the output of the administration menu is cached to see changes from your theme override function you must clear your site cache via the flush all caches link on the menu to override the font size add the following line to your theme s stylesheet body adminmenu fontsize 10px troubleshooting if the menu does not display check the following are the access administration menu and access administration pages permissions enabled for the appropriate roles does your theme output the closure variable if the menu is rendered behind a flash movie object add this property to your flash object s see http drupalorg node 195386 for further information faq q when the administration menu module is enabled blank space is added to the bottom of my theme why a this is caused by a long list of links to module issue queues at drupalorg use administer user management permissions to disable the display drupal links permission for all appropriate roles note that since uid 1 automatically receives all permissions the list of issue queue links cannot be disabled for uid 1 q after upgrading to 6x1x the menu disappeared why a you may need to regenerate your menu visit http examplecom admin build modules to regenerate your menu substitute your site name for examplecom q can i configure the administration menu module to display another menu like the navigation menu for instance a no as the name implies administration menu module is for administrative menu links only however you can copy and paste the contents of adminmenucss into your theme s stylesheet and replace adminmenu with any other menu block id blockmenu1 for example q sometimes the user counter displays a lot of anonymous users but no spike of users or requests appear in google analytics or other tracking tools a if your site was concurrently spidered by searchengine robots it may have a significant number of anonymous users for a short time most web tracking tools like google analytics automatically filter out these requests q i enabled aggregate and compress css files but adminmenucss is still there is this normal a yes this is the intended behavior the administration menu module only loads its stylesheet as needed ie on page requests by loggedon administrative users q why are submenus not visible in opera a in the opera browser preferences under web pages there is an option to fit to width by disabling this option submenus in the administration menu should appear q how can the administration menu be hidden on certain pages a you can suppress it by simply calling the following function in php moduleinvoke adminmenu suppress however this needs to happen as early as possible in the page request so placing it in the theming layer resp a page template file is too late ideally the function is called in hookinit in a custom module if you do not have a custom module placing it into some conditional code at the top of templatephp may work out too contact current maintainers daniel f kudwien sun http drupalorg user 54136 peter wolanin pwolanin http drupalorg user 49851 stefan m kudwien smkka http drupalorg user 48898 dave reid dave reid http drupalorg user 53892 major rewrite for drupal 6 by peter wolanin pwolanin this project has been sponsored by unleashed mind specialized in consulting and planning of drupal powered sites unleashed mind offers installation development theming customization and hosting to get you started visit http wwwunleashedmindcom for more information lullabot friendly drupal experts providing professional consulting education services visit http wwwlullabotcom for more information acquia commercially supported drupal visit http acquiacom for more information  ', 0),
(3, 'help', ' using advanced help the advanced help system is a pluggable system that provides advanced help facilities for drupal and its modules although the advanced help does not provide general help by itself it provides a powerful and easy framework that modules may use to provide their own help modules utilizing advanced help should create a help subdirectory inside their module s directory place the file modulenamehelpini in this subdirectory formatted similar to the following example buses title how buses are tied into the system file buses topicid title title of topic file filename of topic without the html extension weight how important the topic is on the index page parent the optional topic parent to use in the breadcrumb either topic or module topic all topics are addressed by the module providing the topic and by the topic id to embed links use the following format output theme advancedhelptopic module topic inside your help file link to other topics using the format  a href topic module topic   this format will ensure the popup status remains consistent when switching between links use  a href path examplejpg  to reference items within the help directory such as images you wish to embed within the help text use  a href baseurl admin settings siteconfiguration  to reference any normal path in the site if the search module is enabled the contents of help system will be indexed on cron if you enable new modules and wish to immediately index its help text visit the administration reports status report and click the run cron manually link example  don t click this  see  ini file format note  in previous versions advanced help did not require the s wrapped around the topic path and baseurl links this is currently still supported but may be removed in a future version by adding the s these tokens are now not limited to href and src paramaters  ', 0),
(4, 'help', ' translating advanced help to translate advanced help first create a translations help language directory in the module directory then copy the ini file and all html files from the help directory the ini file only needs to keep the titles and if there is a name or index name setting in the advanced help settings portion that should be retained any retained settings should be translated the rest of the data in the ini file may be discarded or ignored each file should then be translated in place when translating a html file you will find that the path keyword will lead to the original directory if you must translate items that are linked such as images use transpath instead which will lead to the translated directory this will allow you to pick and choose which linked items if any will be translated  ', 0),
(5, 'help', ' help ini file format the advanced help configuration file is in simple ini file format divided into sections for each help file plus an optional section for global settings that might be inherited for each help file the first line of an advanced help ini file should be id which will be a comment providing the cvs identifier for the file the indicates a comment character anything after the will be ignored global settings may be put into a section named  advanced help settings   this means that this name is reserved and it cannot be a help file in any module the following settings may be set in this section  line break if set to any value the line break filter will be applied to all help files defined by this module unless that help file specifically is set otherwise by default the line break filter is not applied however help files can be much easier to write with the line break filter on navigation if set to true the navigation will be displayed at the end of the help topic previous topic next topic and child topics css specify a css file that will be used for all help files unless overridden including the css extension this css file must reside in the help directory along with the html files and will not be affected by translation name may be set to override the module name as displayed in both the module index as well as the navigation and breadcrumb trail in general this does not need to be set but a few modules may want to use a more friendly name than appears in the info file index name this may be set to change the name of the module in the module index it overrides the name setting above as well as the module name in its info file hide this may be used to hide a module in the module index this is particularly useful for modules who insert their help files into the hierarchy of another module as might be done by modules that extend views or cck by setting hide true the module will not appear as its own entry each section after that will correspond to a single help file and each one may have the following settings  title the title of the topic presented to the user and used in links if you have special characters in your title be sure to enclose it in quotes file the filename without the html extension used for the topic this is optional if not specified the topic name wil be the file name weight the weight used for sorting topics on the administration page defaults to 0 of unspecified items with the same weight are sorted alphabetically parent the topic id to use in a hierarchy children will be listed beneath parents in the topic list and will have the parent in their breadcrumb trail you may parent this topic to another module s topic by using module topic as the identifier for example views display will make this a child of the display topic in the views module line break if set to true linebreaks will be converted into br and p tags automatically if unspecified will default to off set to 0 to disable the filter if this has been turned on in the global settings css specify a css file that will be used for this file this css file must reside in the help directory along with the html files this will override any css file added by the global system popup width the width in pixels of the popup window defaults to 500 if unspecified popup height the height in pixels of the popup window defaults to 500 if unspecified for example here is a version of the advancedhelphelpini file usingadvancedhelp title using advanced help weight 10 translation title translating advanced help inifile title help ini file format line break true  ', 0),
(6, 'help', ' why advanced help  the advanced help system was designed to replace the original drupal help system which has several flaws that make it hard to create new help hard to maintain existing help and particularly hard to access help the primary goal then is to increase the accessibility of help meaning the ability of both the user and the help text author to access the needed tools to use create maintain and translate the help this system is completely separate from drupal s hookhelp in drupal 6 it actually coexists with it in the future it is hoped that it will completely replace it allowing hookhelp to be deprecated and removed messages added to the top of a page are not really help often these messages are an introduction to a form or a short blurb telling a user what to do with a particular page the problem is these messages are always there they are easily ignored and they come before the actual page in general when users are learning they want to see the page first then ask questions the reverse order is much less conducive to actually teaching a user how to use something by allowing help to be available on request the system conforms more naturally to how most people work advanced help is organized by topic with the hookhelp method help text is organized by url path this is fine if you have help text describing how to use a particular page or what a particular page does but ultimately is limiting because manuals and documentation are usually grouped by topic and those topics are determined by the material itself advanced help allows the documentation author to organize topics as he or she sees fit the only restriction really is that each individual chunk of text needs to stand on its own as a discrete topic what s more modules can insert their topics into another module s hierarchy this would allow the drupal core to create a task based help navigation system which allows modules insert topics into that navigation fluidly this allows modules to continue to keep their systems separate yet integrate into the main system advanced help topics are processed html in their own files this separation makes it easy to find and modify currently everything is lumped together in hookhelp in php strings that are run through t and there is a fair amount of php code necessary in this system that actually gets in the way of writing good explanatory text in fact requiring a documentation author to understand php at all is a detriment the idea that documentation writers need to have php development as a skill seriously reduces the number of available contributors html on the other hand is a much more common skill is relatively easy to learn and the amount of html needed to write documentation is only a little bit more than the html used in forum posts another benefit to not using php is that the files themselves are safe they are unlikely to include malicious php code that could take over the server or do worse things this means that these files can be used relatively easily on the drupalorg hardware so that a module s help files can be made immediately available without needing to download the module it also means that descriptions of the module can be made on drupalorg that are version aware can be corrected easily in cvs with patches but can also be made available with the module so that drupalorg is not required this also means that we could if we wanted package the drupalorg handbooks or a subset of them directly into a drupal distribution or a drupal addon so that drupal administrators can have drupal help without needing to visit drupalorg this can be valuable in locked down corporate environments and on planes but more importantly the handbooks can be made version aware much more easily than the current method on drupalorg the downside to this method is that these books can t easily be made dynamic though the use of alter hooks could allow a module to make modifications to the help as needed doing this could make the help files less useful when you take them out of context advanced help files are translated as a file it is actually not easy to translate documents as strings particularly when the language being used is very much unlike english in fact when translating a document the organization of the sentences may change drastically it is also a burden on the cpu to do this as you are indexing on very long strings translators have a much better time translating a document as a unit because of the presence of the entire context advanced help has its own navigation system by making use of a navigation system specified in a ini file which is not php code and therefore safe to use on drupalorg sites the help can be structured like a book which is typical of online manuals this is familiar to users can be organized and reorganized and allows a module to include significantly richer text without burdening the php code with having its help loaded unnecessarily this book can be navigated hierarchically as well making it easy to keep related topics together advanced help is indexed by the search engine an important goal of this system was to add searchability to the help by being able to enter keywords into the search box and find relevant topics we come up with a system that resembles the kind of help that comes with many operating systems this is very valuable when searching through manuals trying to find out how to do a particular thing this search is specific to the help meaning that the help will not be mixed in with the global node search this can be considered both an advantage and a disadvantage for the most part this help system is meant to provide help to site administrators and content searches should not find it the disadvantage of course is when you want to use it for end user help you will not be able to inline help can be brought in via popups in addition to the manuallike hierarchical navigation advanced help can also provide contextsensitive additional help through a popup while popups are controversial the argument for using them is that when getting help while on a form  a popup will not throw away a user s data browsers are not very friendly to input forms if they are not submitted and navigating away from the form can be dangerous there are various other solutions to this problem but each one has a drawback the drawbacks to popups are well known but mostly it is the irritation of having new windows when getting help though a popup is usually invited help should not interfere with what the operation the user is trying to complete it differs greatly from the uninvited popup which are usually ads or popups meant to prevent users from navigating away from a site these popups can be added to a page with text links or icon links  ', 0),
(7, 'help', ' fields and widgets the content construction kit cck is composed of numerous field and widget modules that can be used to add fields to any content type  ', 0),
(8, 'help', ' manage fields tab this page lets you manage the cck fields in your content type add fields and groups rearrange them access their configuration pages remove them from the content type  ', 0),
(9, 'help', ' add fields and groups the form elements at the bottom of the manage fields page let you add fields and groups to your content types the add existing field row is displayed only if there are fields available in other content types the add new group rows is displayed only if fieldgroup module is enabled your fields and groups will be created after you click the save button at the bottom of the page in subsequent pages you will be presented with the settings form for each field you added you will find more details on the required informations in the following pages  ', 0),
(10, 'help', ' add a new field at the bottom of the manage fields page for a content type you ll find this in order to add a new field to a content type you need to provide the following information label a humanreadable name for the field it will be used in input forms and on displayed content all characters are allowed including spaces accentuated or noneuropean characters field name a machinereadable name for the field it is used internally to identify the field and handle database storage when doing custom theming it is this identifier that you ll use to refer to that field important  the field name cannot be changed once the field has been created allowed characters az unaccentuated 09 and the underscore the length of the field name cannot exceed 32 characters including the field prefix that gets added automatically that is 26 free characters field type the type of data to be stored in that field important  the field type cannot be changed once the field has been created the available field types depend on the modules you have enabled on your site cck comes with 6 basic field types text integer float decimal node reference user reference additional modules can be downloaded to handle other field types such as dates files images look at the cck project page and the complete list of cckrelated modules  widget the form element that will be used to input data for this field on content forms text input select list etc each field type has its own list of available widgets when selecting a field type the list of widgets you can select is automatically updated  ', 0),
(11, 'help', ' add an existing field share a field across content types using a field across several content type can be handy if a piece of data is relevant for several content types a typical use case is a phone number field used in both restaurant and hotel content types even if hotels and restaurants are different enough to deserve their own specific set of fields and thus their own dedicated content types when a field has been added to more than one content type we also say it is shared and that it as several instances at the bottom of the manage fields page for a content type you ll find this in order to add a new instance of an existing field to a content type you need to provide the following information  label  a humanreadable name for the field it will be used in input forms and on displayed content all characters are allowed including spaces accentuated or noneuropean characters field  the field to be shared a field cannot appear more than once in each content type thus only fields that are not already present in the current content type will be proposed as shareable if none the add existing field option is not available on the manage fields page for this content type selecting a field automatically populates the label and widget values with the ones used by the previous field instance but you can change them if needed before submitting the form widget  the form element that will be used to input data for this field on content forms text input select list etc each field type has its own list of available widgets when selecting a field to share the list of widgets you can select is automatically updated  ', 0),
(12, 'help', ' add a new group field groups are used to visually gather several fields that are associated by some sort of logic for instance several text fields that hold the different parts of an address on input forms and displayed content the corresponding fields are enclosed inside an html fieldset at the bottom of the manage fields page for a content type you ll find this in order to add a new group to a content type you need to provide the following information  label  a humanreadable name for the group it will be used in input forms and on displayed content all characters are allowed including spaces accentuated or noneuropean characters group name a machinereadable name for the group it is used internally to identify the group when doing custom theming it is this identifier that you ll use to refer to that group important  the group name cannot be changed once the group has been created allowed characters az unaccentuated 09 and the underscore the length of the group name cannot exceed 32 characters including the group prefix that gets added automatically that is 26 free characters once a group has been created you can define what fields it will enclose by rearranging fields and groups   ', 0),
(13, 'help', ' rearrange fields and groups to change the order of fields grab a draganddrop handle and drag the field to a new location in the list grab a handle by clicking and holding the mouse while hovering over a handle icon remember that your changes will not be saved until you click the save button at the bottom of the page the order you define will be used both on input forms when creating or editing a post and on content display teasers content page rss items you can also change the order of noncck fields like title or file attachments  depending on the field this will affect input forms and or content display some of those fields are not displayed in both contexts if your content type has groups requires the fieldgroup module you can move a field inside a group by dragging it below the row of the group and then slightly to the right before dropping it note that groups can also be reordered but can currently not be nested inside other groups when adding a field or a group you can drag them directly to the intended spot in the list of fields and groups that are already present in your content type before clicking save   ', 0),
(14, 'help', ' remove fields and groups removing a field when you remove a field from a content type the data it holds are permanently erased you will be asked to confirm this action you will have to manually update your views pathauto settings etc if needed note if the field is shared across several content types removing it from one content type does not affect the data for the other content types removing a group removing a group from a content type does not remove the fields it contains and therefore erases no field data  ', 0),
(15, 'help', ' theming cck data in nodes note  these instructions assume you are familiar with the basic concepts of drupal 6 theming for more informations see the theme guide for drupal 6  and more specifically the overriding themable output section there are 3 levels where you can customize how the data in cck fields is displayed in nodes  ', 0),
(16, 'help', ' node templates template files all themes usually come with a default nodetplphp template drupal core lets you use the following variant suggestion node contenttypename tplphp ex nodestorytplphp if present will be used to theme a story node important  whenever you add new template files in your theme you need to rebuild the theme registry or the theme engine won t see them you can do that by visiting the administer modules page or using devel module  s clear cache link template variables cck makes the following variables available in your theme s node templates fieldname rendered contains the rendered html for the field including the label and all the field s values with the settings defined on the display fields tab groupname rendered contains the rendered html for the fieldgroup if any including the label and all the group s fields with the settings defined on the display fields tab this variable therefore includes the html contained in all the fieldname rendered variables for the group s fields fieldname contains the raw values of the fields in the usual arrayformat used internally by cck what you find in there depends on the field type each value also contains a view element that holds the readytodisplay value as rendered by the formatter for instance array 0 array nid 5 view a href node 5 title of node 5 a  raw data are not sanitized for output it is therefore not advised to use them directly  use the view value or run the values through contentformat  excluding fields from the content variable by default the content variable used in node templates contains the rendered html for the whole node cck fields and fieldgroups but also body file attachments fivestar widgets if for some fields you want to use the more finegrained variables described above you might want to use the exclude checkboxes on the display fields screen so that the output of those fields is excluded from the content variable you can then customize the display and layout of some cck fields or groups using the fieldname rendered groupname rendered variables and trust content to display the rest without getting duplicate information advanced trick the exclude checkboxes affect all active themes on sites with multiple themes however the list of fields to exclude from content might need to be different across the themes depending on how their respective node templates are structured a theme can bypass those settings by overriding the themecontentexclude function to specify the list of fields to exclude for this theme see the phpdoc of the function for more information  special case nodes in nodereference fields in addition to the above the following suggestions will be looked for in priority for nodes that are displayed as values of a nodereference field using the teaser or full node formatters nodenodereference referringfieldname typename tplphp ex nodenodereferencefieldnoderefstorytplphp if present will be used to theme a story node when refererenced in the fieldnoderef field nodenodereference typename tplphp ex nodenodereferencestorytplphp if present will be used to theme a story node when refererenced in any nodereference field nodenodereference referringfieldname tplphp ex nodenodereferencefieldnodereftplphp if present will be used to a node refererenced in the fieldnoderef field nodenodereferencetplphp if present will be used to theme nodes referenced in nodereference fields the following additional variables are available in templates for referenced nodes referringfield the nodereference field that references the current node referringnode the node referencing the current node  ', 0),
(17, 'help', ' field templates fieldlevel theming determines how the values of a given field are displayed the resulting output ends up in the content and fieldname rendered variables in the node templates template files in order to customize field themeing copy the contentfieldtplphp template file into your theme s root folder please keep the contents of the cck theme folder untouched for the same reason need to copy the file instead of just moving it edit that copy to your liking see the comments in cck theme content contentfieldtplphp for a list of all variables available in this template template suggestions in addition the theme layer will also look for fieldspecific variants suggestions in the following order of precedence contentfield fieldname contenttypename tplphp ex contentfieldfieldmyfieldstorytplphp if present will be used to theme the fieldmyfield field when displaying a story node contentfield contenttypename tplphp ex contentfieldstorytplphp if present will be used to theme all fields of story nodes contentfield fieldname tplphp ex contentfieldfieldmyfieldtplphp if present will be used to theme all fieldmyfield field in all the content types it appears in contentfieldtplphp if none of the above is present the base template will be used important  suggestions work only if the theme also has the base template file if your theme has contentfield tplphp files it must also have a contentfieldtplphp file whenever you add new template files in your theme you need to rebuild the theme registry or the theme engine won t see them you can do that by visiting the administer modules page or using devel module  s clear cache link see the working with template suggestions section of the theme guide for drupal 6 for more informations about templates and template suggestions  ', 0),
(18, 'help', ' formatter theme functions formatters are used to turn the raw data for a single field value into html the display fields tab lets you chose which formatter you want to use for each of your fields in cck 20 for drupal 6 all formatters now go through the theme layer therefore overriding a formatter s theme is another way you can alter how your values are displayed whereas changing contentfieldtplphp lets you change the html that wraps the values most formatters come as theme functions but some might use templates instead either way you can override them using the usual drupal 6 theme override practices for more informations see the theme guide for drupal 6  and more specifically the overriding themable output section  ', 0),
(19, 'help', ' nodereference field the nodereference field stores the nid of a related node the title of the related node is usually displayed as the value of this field the nodereference field can use an autocomplete widget or when used with optionwidgets  the available values can be presented to the end user in a dropdown select list checkboxes or radios a nodereference field can be used in views to create a relationship to another node to allow you to use any field argument or filter from the related node in your view  ', 0),
(20, 'help', ' number field the number field stores numeric data in the database it can either be an integer value a decimal value or a float value the number field provides a place for the administrator to create a list of allowed values for the field when used with optionwidgets  the allowed values are presented to the end user in a dropdown select list checkboxes or radios  ', 0),
(21, 'help', ' optionwidgets optionwidgets creates dropdown select lists checkboxes and radio widgets that can be used with fields that have specific allowed values the number and text fields have settings for creating lists of allowed values that can be used in optionwidgets the nodereference and userreference fields use optionwidgets to present the possible values in select lists or checkboxes  ', 0),
(22, 'help', ' text field the text field stores textual data in the database it can either be a simple textfield to hold up to 255 characters or a textarea of an unlimited size that can be combined with input filters to store lengthy descriptions and html code the text field provides a place for the administrator to create a list of allowed values for the field when used with optionwidgets  the allowed values are presented to the end user in a dropdown select list checkboxes or radios  ', 0),
(23, 'help', ' overview the date module defines a highly configurable date time field type for the content module and a date api that can be used by other applications  ', 0),
(24, 'help', ' date api once the date api is installed all functions in the api are available to be used anywhere by any module if the date timezone module is installed the system site timezone selector and the user timezone selectors are overwritten to allow the selection of timezone names instead of offsets proper timezone conversion requires knowledge of those timezone names something that is not currently available in drupal core and the change in selectors makes it possible to track it in most cases you should enable the date timezone module any time you use the date api to be able to set the site and user timezone names it is not enabled by default in case another module is setting timezone names in the database the api uses the php 52 date functions to create and manipulate dates and contains an option module that will emulate those functions in earlier versions of php if you are using php 4 or php 50 or 51 native date handling won t work right install the datephp4 module to enable wrapper functions so this code will work in old php versions  ', 0),
(25, 'help', ' new features the date api now uses php 52 date functions for better date and timezone handling and has php 4 emulations for those functions so the module will work in php4 although the code will work with php 4 it is significantly faster and more efficient under php 52 or higher so php 52 is highly recommended the database query handling has been completely reworked to take advantage of database timezone handling when available with a fallback to the older and less reliable method of using offsets to do timezone adjustments no more need for the adodb date library historical dates earlier than 1970 and later than 2038 are handled without any external code ical integration is greatly improved an ical parser can parse events alarms most types of dates and timezones duration repeat rules and more the date api creates date elements that can be used by any module including dateselect datetextfield and datetimezone a new date timezone module overrides the site and user timezone selectors to allow you to select a timezone name instead of a timezone offset and that stored name is used to properly adjust date values it also detects the user s timezone name automatically and updates the user record with that name a new date popup module creates a jquery popup calendar date picker and time picker and the element is available to other modules as a form type of datepopup the date module now has lots of new ways to define default values you can set a the default to blank now or relative where relative is something like 90 days the to date has a separate default value which can be the same as the from date or do something different a date repeat api module has been added which can be used by any other module the cck date module uses it to allow you to select repeating as a type of multiple date present the user with a form to select the repeat rules for their date and then create all the multiple values that match those rules  ', 0),
(26, 'help', ' date field the cck date field is one of the content construction kit cck field modules  it uses the date api to create date fields and widgets there are a number of date fields and widgets you can create with this module  ', 0),
(27, 'help', ' date php4 note  the date api is designed to use the new php date and timezone functions that are available in php 52 and above if you re using an earlier version of php you ll need to enable the date php4 module which provides some wrapper code to emulate those functions the wrapper code is slower and less efficient than the native date functions so if at all possible you will want to run on a server that uses php 52 or higher for the best performance some distros like red hat use php 51 instead see installing php 52 on redhat for ideas on how to update that php 4 substitutions for the php 5 date functions are supplied if the date php4 module is enabled use the php 5 functions in your code as they would normally be used and the php 4 alternatives will be automatically be substituted in when needed you cannot do everything with these functions that can be done in php 5 but you can create dates find timezone offsets and format the results timezone handling uses native php 5 functions when available and degrades automatically for php 4 to use substitutions like those provided in previous versions of the date and event modules read the doxygen documentation in this module for more information about using the functions in ways that will work in php 4 the following functions are emulated in php4 datecreate datedateset dateformat dateoffsetget datetimezoneset timezoneabbreviationslist timezoneidentifierslist timezoneoffsetget timezoneopen  ', 0),
(28, 'help', ' date field date fields the cck date field uses the date api to create date fields and widgets you have a choice of creating an iso date or a unix timestamp if you are porting information from another application you may want to create a field using a type that matches the source data some advantages and disadvantages of each include datestamp unix timestamp stores the date as an integer takes up less room in the database because it s smaller often easier to use for date calculations because you can increase or decrease it just by adding or subtracting seconds it is the format used by php date functions it must be filled with a complete date year month day hour minute second so you sometimes have to arbitrarily set some of these values even if they are not applicable date iso date stores the date in an iso format yyyymmddthh mm ss the data is in a humanreadable form you can use it for incomplete dates ie only a year or only a year and a month and pad the other values with zeros so it does not appear to be any more precise than it really is it is a format that is internationallyrecognized and it is used asis on many web sites and in many applications datetime stores the date in the database s native date format yyyymmdd hh mm ss the data is in a humanreadable form you can use it for incomplete dates ie only a year or only a year and a month and pad the other values with zeros so it does not appear to be any more precise than it really is it can take advantage of the database s date handling functions without any conversion date widgets there are several widgets to choose from to control how users can enter data for this field text field the text field date widget uses a custom format set in the field settings like 31122008 as a fallback the widget will try to accept input allowed by the php strtotime function  this allows the user to type a date in in many natural formats like march 31 1980 there are limitations to strtotime so setting a custom format is more reliable the strtotime function will assume date shortcuts are in american format mm dd yy and strtotime will not work for dates prior to 1970 select list the select list date widget presents users with a dropdown list or textfield for each part of the date year month day hour etc the whole selector is collapsed onto a single line using css except for the timezone selector if datespecific timezones are collected the selector is highly configurable and you can set it up to use 5 10 or 15 minute increments for minutes and seconds or make some parts of the selector use textfields instead of dropdowns useful to allow any year without creating a huge dropdown selector jquery popup calendar the javascript popup calendar is offered as an input alternative if the date popup module is installed the date is split into date and time fields and the date field uses a jquery popup calendar and the time field uses a jquery timeselector widget that only allows valid time input if you have the date repeat module enabled you will also see options for each of those widgets that include a repeat options selection form that will allow the user to choose values like every week or the last tuesday  ', 0),
(29, 'help', ' date formatter display the date field can be displayed or formatted several ways some configurable in the date settings others that are automatically provided as options you ll see these formatters as options on the display fields screen and when you add the fields to views you can also use these formatters in custom code by doing something like print contentformat fielddate node fielddate 0 iso  formatter settings in many places you can further control the way multiple value dates will be displayed with formatter settings the formatter settings look like default as time ago long medium short date only time only hidden display from and to dates display from date only display to date only show value s starting from ending on display repeat rule hide repeat rule the number of values should be a numeric value or blank to show all dates that match your other options starting from and ending on can be a fixed dates in iso format like 20090303t103000 or relative times like now or now 1 day  formats and format types formatter options include default the main way to display this date configured in the date settings defaults to the site short format short the site short format medium the site medium format long the site long format time display the date time only using the time format in the default display timetimezone display the date time and timezone using the time format in the default display iso display the date in the standard iso format of yyyymmddthh mm ss ical display the date in the standard ical format of yyyymmddthhmmss timestamp display the date as the unix timestamp value formatinterval display the date as xx days xx hours ago or xx months xx days from now to set up custom formats and formatters go to admin settings datetime formats  you can either use a preconfigured display format or create your own formatters and formats define a php date format string like mdy h i see http phpnet date for more details on custom format strings  ', 0),
(30, 'help', ' date copy the date copy module allows you to import date data into cck nodes currently you can convert event nodes to cck nodes or import date data from an ical feed importing from event nodes if you currently have date information in event nodes and want to get the event dates into cck date fields instead you can do this using the date copy module included with the date module first create the content type you want to import your events into and make sure the content type has a cck date field and a field to hold the event description either a body or a text field you can create a new content type for this purpose or add a cck date field to the current event type depending on whether you want to create new nodes and nids or use the current ones make sure you set up the cck date field to have both a from date and a to date if your events have eventspecific timezones make sure the cck date field is set up to use the date s timezone go to admin content management date import export import events and select events as the content type to import from and your new content type as the type to import to only content types that have date fields will appear in the list of available content types if you have added the new date fields to the current content type be sure to select the option to not delete the old node after the import if you have created a new content type you will probably want to delete the old nodes you can select the number of items to import and the starting nid import will be done in ascending nid order use that to import a single node as a test to be sure the results are what you want once your nodes seem to be importing correctly go ahead and import more of them you may want to do them in batches to keep the server from timing out  ', 0),
(31, 'help', ' ical import you can import ical feeds from other sources into your database by using the feed api and feed api mapper  check create an ical parser and create a cck date feed mapper for the current status of patches needed to get this working decide what content type will be used for nodes imported from your ical feed it can be a separate content type for each feed or they can be combined into other content types make sure the content type you select has a date field that can be used for the ical date plus fields for any other ical information that will be imported create a new content type for ical feeds scroll down to the bottom of the content type edit page and look for the place to set up feed information set it up to be a feed type that uses the ical parser go to create content and create a new node using the ical feed content type when you create the node you will find a place to input the url of the feed and select the content type for the resulting nodes once the feed node has been created you will see a tab at the top where you can map its data to the fields in your target content type scroll down and look for options dtstart and options dtend and map them to the from date and to date fields then map any other information from the feed to right fields in the target node once the fields have been mapped use the remove items tab at the top of the page to eliminate nodes that may have been created before the fields were mapped then use the refresh tab to reimport them you can see in the content screen in the administration area that the nodes have been imported  ', 0),
(32, 'help', ' views integration ', 0);
REPLACE INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(33, 'help', ' generic date argument the generic date argument is based on iso 8601 date duration and time interval standards and allows you to create an flexible argument for any date range for any date field the argument expects a value like 2006010120060115 or 2006w24 or p1w separate from and to dates or date and period with a double hyphen from and to dates in argument are iso dates but can be shortened and missing parts will be added omitted parts of iso dates will be assumed to be the first possible for the from date or the last possible for the to date value in that time period the to portion of the argument can be eliminated if it is the same as the from portion use instead of a date to substitute in the current date and time shortcuts are available use periods p1h p1d p1w p1m p1y to get next hour day week month year from now use date before p sign to get next hour day week month year from that date the iso standard calls for a separator between a date and the p but the separator is optional between a start date and a period in this argument to make the result easier to read use format like 2006w24 to find iso week number 24 in year 2006 examples  argument resulting query range 2006w24 24th iso week in 2006 2006 the whole year of 2006 200603 the whole month of mar 2006 200602200703 feb 1 2006 to mar 31 2006 20060831t1420060831t16 the 14th to 16th hours of aug 8 2006 20061231 now to 20061231t235959 p3h now to three hours from now p1y90d now to 1 year and 90 days from now 20060305p1w the week starting mar 5 2006 200601p3m 3 months starting jan 2006 see http enwikipediaorg wiki iso8601 weekdates for definitions of iso weeks see http enwikipediaorg wiki iso8601 duration for definitions of iso duration and time interval  ', 0),
(34, 'help', ' generic date filter the date api provides a generic date filter that can filter on any views date field  ', 0),
(35, 'help', ' embedding views embedding views embed a date browser view anywhere using the format dateembedview viewname displayname settings args settings are used to override some values of the view the primary setting that is useful here is a setting for blockidentifier the view s blockidentifier is used to control individual instances of regular and embedded views that contain date navigation so that they move separately or together all views that use the same identifier will move together all views that use different identifiers will move independently the identifier will show up in the url as a querystring like node 275 mini calendar 200810 examples   php print dateembedview myview page1 this will embed the first page display in the view myview php print dateembedview myview page1 array blockidentifer embedded array 2008w45 this will embed the first page display of the view and use embedded as an identifier set to show the week view for week 45 of 2008 php print dateembedview myview block1 array blockidentifier mini array 200807 this will embed the first block view of the view and use mini as an identifier set to show the month view for july 2008  ', 0),
(36, 'help', ' repeating date options dates will match any selection within the same box january or june when more than one box has criteria selected all of them are combined to create repeats january or june and day 1 or day 15 positive numbers count from the beginning of the period negative numbers count from the end of the period ie 1 is the last 2 is the next to last etc if you select every year above and march from month and 1 and 15 from day of month in the advanced options you will be selecting the 1st and 15th days of march of every year if you select every other month above and second tuesday in the advanced options you will be selecting the second tuesday of every other month if you select every year above and second tuesday in the advanced options you will be selecting the second tuesday of every year if you select every month above and january and june and first saturday in the advanced options you will be selecting the first saturday in january or june if you select every month above and 1 from day of month in the advanced options you will be selecting the last day of every month  ', 0),
(37, 'help', ' the php datetime object the datetime object is defined in php versions 52 and greater full documentation can be found at phpnet datetime  php s printr    devel module  s dpm   and similar functions and most debuggers are not able to show the properties of datetime objects the dateformat  function provides a good alternate method to debug datetime objects an example of its usage follows including some common datetime manipulation functions php create a datetime object for 11 november 2008 5pm chicago time date datecreate 20081111 170000 timezoneopen america chicago find out what time it is in new york datetimezoneset date timezoneopen america newyork now move it ahead to the following tuesday datemodify date 1 tuesday print out the result print dateformat date l r tuesday tue 18 nov 2008 180000 0500 the date api provides a helper function datemakedate string timezone type where string is a unixtimestamp an iso date or a string like yyyymmdd hh mm ss timezone is the name of the timezone this date is in and type is the type of date it is dateunix dateiso or datedatetime it creates and return a date object set to the right date and timezone  ', 0),
(38, 'help', ' date api functions preconfigured arrays both translated and untranslated values are available the dateweekdaysordered function will shift an array of week day names so it starts with the site s first day of the week otherwise the weekday names start with sunday as the first value the expected order for many php and sql functions datemonthnames datemonthnamesabbr datemonthnamesuntranslated dateweekdays dateweekdaysabbr dateweekdaysuntranslated dateweekdaysordered dateyears datehours dateminutes dateseconds datetimezonenames dateampm  miscellaneous date manipulation functions predefined constants and functions that will handle pre1970 and post2038 dates in both php 4 and php 5 in any os dates can be converted from one type to another and date parts can be extracted from any date type datedatetime dateiso dateunix datearray dateobject dateical dateconvert dateisvalid datepartisvalid datepartextract  date calculation and navigation datediff will find the time difference between any two days measured in seconds minutes hours days months weeks or years datedaysinmonth datedaysinyear dateweeksinyear datelastdayofmonth datedayofweek datedayofweekname datediff  date regex and format helpers predefined constants an array of date format strings and their equivalent regex strings dateregexloose is a very loose regex that will pull date parts out of an iso date with or without separators using either t or a space to separate date and time and with or without time dateformatdate is similar to formatdate except it takes a date object instead of a timestamp as the first parameter dateformatiso dateformatdatetime dateformatunix dateformatical dateregexiso dateregexdatetime dateregexloose dateformatdate datet dateshortformats datemediumformats datelongformats dateformatpatterns  ', 0),
(39, 'help', ' form elements usage example of date elements within forms  enable the date api module you might want to add a dependency in the info file of your module date api uses hookelements  to create custom form types you can check the file dateapielementsinc for the list of form types available and for other configuration options adding a date form element is then easy php your form builder function mymoduleform formstate form array snip add many fields to your form creating the date time element starts here provide a default date in the format yyyymmdd hh mm ss date 20081231 000000 provide a format using regular php format parts see documentation on phpnet if you re using a dateselect the format will control the order of the date parts in the selector rearrange them any way you like parts left out of the format will not be displayed to the user format ymd h i form date2 array type dateselect types datetext and datetimezone are also supported see inc file title select a date defaultvalue date dateformat format datelabelposition within see other available attributes and what they do in dateapielementsinc datetimezone america chicago optional if your date has a timezone other than the site timezone dateincrement 15 optional used by the dateselect and datepopup elements to increment minutes and seconds dateyearrange 3 3 optional used to set the year range back 3 years and forward 3 years is the default snip more fields including the submit button return form these are selfvalidating elements you shouldn t need to do anything except include them in your form you pass them parameters for the timezone format and a default value in the format yyyymmdd hh mm ss and it will convert your input into the format the element wants split the date and time into different fields as needed then accept and validate the user input and convert it back into a string in the same format you originally provided yyyymmdd hh mm ss so you pass it a string and it will pass back a string by the time you get to your own validation function you are responsible for doing your own timezone conversion the element uses the timezone just so it can create a date object with the right timezone for doing its formatting so if you need to do timezone conversion you pull your utc date out of the database and convert it to a local date pass that value to the date element then take what it returns and convert it back to utc and store it in the database again if the date popup module is enabled a datepopup element can be used it works like the other elements but splits the date and time into separate parts you control whether it uses date or date and time by the format you supply in dateformat if you don t have any time parts in the format you won t get a time element note that the jquery widget the date part of the popup can only accept a limited number of formats things like ymd or m d y or dmy  ', 0),
(40, 'help', ' timezone handling creating a timezone form item using date api this is simple just use the datetimezone type which is provided by dateapimodule php form timezone array type datetimezone defaultvalue timezone description select a timezone if all the events will happen in the same place select that place s timezone  converting to and from utc in the new system you just need to know the timezone name and either the utc or local time we store the utc time and the timezone name in the database in two separate fields we retrieve that data and do php date the utc value from the database localzone the name of the local timezone type the type of date value datedatetime dateiso or dateunix date datemakedate date utc type datetimezoneset date timezoneopen localzone date now contains the local value of the date output it like print dateformatdate date custom m d y h i to convert a local date back to utc to store it in the database do php date local date value localzone the name of the local timezone type the type of date value datedatetime dateiso or dateunix date datemakedate date localzone type datetimezoneset date timezoneopen utc date now contains the utc value of the date output it like print dateformatdate date custom m d y h i  use of timezone abbreviations the api doesn t handle timezone abbreviations at all there s no way to do it right because they are not unique est could be eastern standard time or european summer time we need the full undeprecated timezone name which looks like america chicago it is comprised of the name of the continent and the major city in the timezone older names like us central are deprecated because the area names change but city names rarely do some good info about timezones is at http enwikipediaorg wiki zoneinfo also we do not use spaces in the timezone names so we use america newyork not america new york the php 52 date functions and mysql native timezone handling all expect names without spaces in them to work correctly you can use the php function timezonenamefromabbr  to try to translate to and from abbreviations but it s not entirely reliable as noted above if we have the current offset and we know if it s currently daylight savings time or not you can combine that with the abbreviation to get the timezone name but that s a lot of if s timezone names the complete list of allowed undeprecated timezone names is africa algiers africa asmera africa bangui africa blantyre africa brazzaville africa bujumbura africa cairo africa ceuta africa daressalaam africa djibouti africa douala africa gaborone africa harare africa johannesburg africa kampala africa khartoum africa kigali africa kinshasa africa lagos africa libreville africa luanda africa lubumbashi africa lusaka africa malabo africa maputo africa maseru africa mbabane africa mogadishu africa nairobi africa ndjamena africa niamey africa portonovo africa tripoli africa tunis africa windhoek america adak america anchorage america anguilla america antigua america araguaina america aruba america asuncion america atka america barbados america belem america belize america boavista america bogota america boise america buenosaires america cambridgebay america cancun america caracas america catamarca america cayenne america cayman america chicago america chihuahua america cordoba america costarica america cuiaba america curacao america dawson america dawsoncreek america denver america detroit america dominica america edmonton america eirunepe america elsalvador america ensenada america fortwayne america fortaleza america glacebay america godthab america goosebay america grandturk america grenada america guadeloupe america guatemala america guayaquil america guyana america halifax america havana america hermosillo america indiana indianapolis america indiana knox america indiana marengo america indiana vevay america indianapolis america inuvik america iqaluit america jamaica america jujuy america juneau america kentucky louisville america kent