(41, 'help', ' ical parser standardized ical parser and creator the ical parser is found in dateapiicalinc which is not included by default include that file if you want to use these functions this feature can be used to parse vevents vlocations valarms and all kinds of timezone options and repeat rules for ical imports the ical parser is used by feed api to import ical feeds  dateicalexport dateicalimport dateicaldateformat  ', 0),
(42, 'help', ' views date handling custom modules and add their own dates to the list the date api views filter and date api views argument can handle see the following example for the way that core dates have been added implementation of hookdateapifields on behalf of core fields all modules that create custom fields that use the viewshandlerfielddate handler can provide additional information here about the type of date they create so the date can be used by the date api views date argument and date filter function dateapidateapifields field values array the type of date dateunix dateiso datedatetime sqltype dateunix timezone handling options none site date utc tzhandling site needed only for dates that use date tzhandling timezonefield needed only for dates that use date tzhandling offsetfield array of tablefield values for related fields that should be loaded automatically in the views sql relatedfields array granularity of this date field s db data granularity array year month day hour minute second switch field case userscreated case usersaccess case userslogin case nodecreated case nodechanged case noderevisionstimestamp case filestimestamp case nodecountertimestamp case accesslogtimestamp case commentstimestamp case nodecommentstatisticslastcommenttimestamp return values  ', 0),
(43, 'help', ' readme readmetxt a module containing helper functions for drupal developers and inquisitive admins this module can print a log of all database queries for each page request at the bottom of each page the summary includes how many times each query was executed on a page and how long each query took it also a block for running custom php on a page a block for quickly accessing devel pages a block for masquerading as other users useful for testing reports memory usage at bottom of page more this module is safe to use on a production site just be sure to only grant access development information permission to developers also a dpr function is provided which pretty prints arrays and strings useful during development many other nice functions like dpm dvm ajax developers in particular ought to install firephp core from http wwwfirephporg and put it in the devel directory your path to fbphp should looks like devel firephpcore lib firephpcore fbphp you can use svn checkout http firephpgooglecodecom svn trunk trunk libraries firephpcore then you can log php variables to the firebug console is quite useful included in this package is also develthemermodule which outputs deep information related to all theme calls on a page develnodeaccess module which prints out the nodeaccess records for a given node also offers hooknodeaccessexplain for all node access modules to implement handy develgeneratemodule which bulk creates nodes users comment terms for development macro module has moved to http drupalorg project macro compatibility notes modules that use ahah may have incompatibility with the query log and other footer info consider setting globals develshutdown false in order to avoid issues modules that use ajax should idenify their response as contenttype text javascript the easiest way to do that is run your reply through drupaljson author maintainer moshe weitzman weitzman at tejasa dot com  ', 0),
(44, 'help', ' readmedevelnodeaccess readme this module contains tools for developers using access control modules to restrict access to some nodes it is intended to help catch some common mistakes and provide feedback to confirm that restricted nodes are in fact visible only to the intended users provides a summary page which queries the nodeaccess table and reports common mistakes such as the presence of drupal s default entry which grants all users read access to all nodes also reports the presence of nodes not represented in nodeaccess table this may occur when an access control module is installed after nodes have already been created provides a block which shows all nodeaccess entries for the nodes shown on a given page this gives developers a quick check to see that grants are provided as they should be this block autoenables to the footer region you may move it as desired if you enable dba debug mode on the devel settings page you will get more information provides a second block that shows and explains the crud access rights of the 10 most recently active users this block is disabled by default because it has a huge overhead if views module is installed allows browsing of nodes by realm including those nodes not in the nodeaccess table null realm wishlist things i d like to see but haven t had time to do automatically solve common problems ie delete the all realm entry and automatically save all nodes not in the nodeaccess table nicer feedback indicating whether nodes are visible to the public or not ie use color coding or icons summary does not differentiate between view grants and other types of grants i personally use nodeaccess only for view grants so i m not sure exactly what else it should show staff original author dave cohen aka yogadex on drupalorg current maintainer hans salvisberg aka salvis on drupalorg  ', 0),
