(46, 'help', ' readmedevelnodeaccess readme this module contains tools for developers using access control modules to restrict access to some nodes it is intended to help catch some common mistakes and provide feedback to confirm that restricted nodes are in fact visible only to the intended users provides a summary page which queries the nodeaccess table and reports common mistakes such as the presence of drupal s default entry which grants all users read access to all nodes also reports the presence of nodes not represented in nodeaccess table this may occur when an access control module is installed after nodes have already been created provides a block which shows all nodeaccess entries for the nodes shown on a given page this gives developers a quick check to see that grants are provided as they should be this block autoenables to the footer region you may move it as desired if you enable dba debug mode on the devel settings page you will get more information provides a second block that shows and explains the crud access rights of the 10 most recently active users this block is disabled by default because it has a huge overhead if views module is installed allows browsing of nodes by realm including those nodes not in the nodeaccess table null realm wishlist things i d like to see but haven t had time to do automatically solve common problems ie delete the all realm entry and automatically save all nodes not in the nodeaccess table nicer feedback indicating whether nodes are visible to the public or not ie use color coding or icons summary does not differentiate between view grants and other types of grants i personally use nodeaccess only for view grants so i m not sure exactly what else it should show staff original author dave cohen aka yogadex on drupalorg current maintainer hans salvisberg aka salvis on drupalorg  ', 0),
(47, 'help', ' readme description this module adds diff functionality to the revisions tab allowing users to nicely view all the changes between any two revisions of a node users may also preview their changes before saving a new node technical diff compares the raw data not the filtered output making it easier to see changes to html entities etc the diff engine itself is a gpl ed php diff engine from phpwiki api this module offers hookdiff which modules may use to inject their changes into the presentation of the diff for example this is used by cckinc uploadinc and taxonomyinc in this package todo consider using in core maintainers moshe weitzman http drupalorg moshe derek wright http drupalorg user 46549 rtzi http drupalorg user 73064  ', 0),
(48, 'help', ' readme  id readmetxt v 15 20090217 003901 agileware exp editview is a views plugin that allows you to create views in which nodes are editable and new nodes can be created editview works with or without javascript enabled installation 1 ensure that views is installed 2 unpack the editview tarball in your sites all modules directory 3 enable editview at administer site building modules usage editviews are created just like any other type of view with a few caveats 1 add or edit a node view 2 if you want to be able to add new nodes in the view set the style to editview in basic settings otherwise you can choose any style that allows you to set a row style and set the row style to editview 3 include any required fields in the view or new nodes will fail validation about editview editview was developed by agileware pty ltd http wwwagilewarenet and cosponsored by xu media solutions http xumediaorg and agileware  ', 0),
(49, 'help', ' readme  field permissions module id readmetxt v 1123 20091114 123251 markuspetrux exp original author markuspetrux http drupalorg user 39593 contents of this file overview usage requirements installation upgrading from cck content permissions overview the field permissions module is a dropin replacement for the content permissions module shipped with cck the key differences are it allows site administrators to set fieldlevel permissions to edit or view cck fields in any node and optionally new feature compared to content permissions edit or view permissions for nodes owned by the current user permissions for each field are not created by default instead administrators can enable these permissions explicitly for the fields where this feature is needed usage once field permissions module is installed you need to edit the field settings form to enable permissions for each where you need this feature you can enable any of the following permission types create field edit on node creation edit any field regardless of its node author edit own field on node created by the user view any field regardless of its node author view own field on node created by the user use these options to enable role based permissions for this field when permissions are enabled access to this field is denied by default and explicit permissions should be granted to the proper user roles from the permissions administration page on the other hand when these options are disabled field permissions are inherited from node view and or edit permissions in example users allowed to view a particular node will also be able to view this field and so on requirements cck 6x25 or higher http drupalorg project cck field permissions requires that hookfieldaccess is invoked with account as 3rd argument added to cck in 6x22 see 336174 1 and node as 4th argument added to cck in 6x25 see 514452 2 1 http drupalorg node 336174 2 http drupalorg node 514452 installation be sure to install all dependent modules copy all contents of this package to your modules directory preserving subdirectory structure go to administer site building modules to install module review the settings of your fields you will find a new option labelled field permissions that allows you to enable permissions per field it is disabled by default upgrading from cck content permissions the field permissions module is fully compatible with the permissions already defined with content permissions module shipped with cck 1 make backups to ensure you can easily fallback in case of any trouble 2 install field permissions module while content permissions module is still enabled 3 disable and then uninstall content permissions module 4 you can now check your existing permissions are still there in the permissions administration screen 5 now you may wish to disable permissions for fields where this feature is not really needed  ', 0),
(50, 'help', ' readme  id readmetxt v 12521 20080419 113244 augustin exp introduction this module is for people who want a custom front page to their drupal sites the key functionality of this module is outlined below if you are comfortable with theming using a mix of php html i recommend you check out the handbook pages i have added to drupalorg which explains how a more advanced method of theming your front page http drupalorg node 46017 this module is intended for drupal version 6x it will not work with earlier versions key functionality 1 allows you to specify a custom front page based on role type eg for a musicians website you could have a different front page for drummers guitarists singers bass players etc 3 allows you to have a full front page or splash page a completely different layout to your main drupal site or alternatively as a themed full page ie it loads with your default drupal site theme layout 4 automatically redirect users to a specific page or path 5 disable your site for everyone but administrators and display a custom under maintenance message 6 display a custom mission style message for authenticated users who have not visited the site for a set period eg if you have had a significant update to the site you might want to have a special notice for users who haven t visited for 1 month or 1 week etc 7 override your home and breadcrumb links on your site eg you might have a splash front page that you don t want visitors already on your site returning to when they click on home 8 you can include php html or both in your frontpage installation 1 upload or copy the front directory and its content to your modules folder 2 go to the administer section of your drupal site 3 click on modules 4 enable the frontpagemodule 5 go to administer site congifuration advanced front page settings 6 paste in the text html php contents of your front pages 7 once you are happy with your frontpages set the default front page setting to be frontpage 8 go to administer user management permissions and enable access front page for anonymous authenticated users important note for those using pathmodule url alias please ensure you have no other pages setup with the url alias frontpage when installing the frontpagemodule which uses the frontpage url alias by default promoted to front page example snippet the default front page when you install drupal for the first time is node which displays a list of node teasers where the nodes have been tagged as pages that are promoted to front page if you want to recreate that node listing after installing the frontpagemodule simply paste the following snippet into the text area provided on the frontpage settings page and select the php filter before saving your new configuration uninstall 1 go to administer site configuration advanced front page settings and change the default front page to something other than frontpage eg node 2 go to administer modules and deselect the frontpagemodule from your list of modules 3 using ftp or other file manager remove the frontpagemodule files and folder hope you find it useful this module has been developed by a few members of the drupal community and we re always looking for ideas for improving it email me or post a message on the drupalorg site if you have any ideas on how we can improve the module dublin drupaller dub dublindrupallercom  ', 0),
