(52, 'help', ' configuring and using the gmap filter if you would like to use gmap macros directly in nodes you will need to activate the gmap filter on one or more input formats  to add a new input format click the add input format tab and fill in the form to reconfigure an existing format click the configure link for the input format you wish to change on the input formats page if you are using the html filter or another filter that strips or manipulates html content it is highly recommended to keep them above the gmap filter in the filter order when configuring an input format click the rearrange tab to see and change the filter order after adding the gmap filter  you can paste gmap macros into a node and they will turn into maps when viewing the node if you have the gmap macro builder module installed you can easily create a macro suitable for pasting into a node read http drupalorg node 213156 for more information on input formats  ', 0),
(53, 'help', ' using gmap from php this documentation is still in flux the gmap api is a simple way to create google maps from a macro or php code it allows other modules to integrate google maps into their drupal site among other things the gmap api can be used by theme developers to integrate google maps into portions of their theme or by developers to insert a map into any block of php concepts baselayer the actual map street map topological map satellite imagery etc that everything is being displayed upon this may also be referred to as the map type gmap macro a gmapspecific textbased representation of a google map overlay a transparent layer drawn on top of the baselayer programming api there are two methods of inserting a google map using the gmap api you may either describe your map with an associative array or you may use a gmap macro introduced in readmetxt gmap macros are appropriate for creating maps via the web interface gmap arrays are more appropriate if you are writing code to generate a complex map macros each attribute of a macro is separated by a and uses an to define that attribute possible attributes are center width height zoom type control align id markers feed line circle polygon and rpolygon see the macrodictionarytxt for an explaination of each of these attributes you can convert a macro into a gmap array with the function gmapparsemacro if you need to parse a macro generated with an old version of gmap where the point format was longitude latitude set version to 1 gmapparsemacro mymacro 1 otherwise you may omit it function gmapparsemacro convert a macro string into a gmap array param macrotext macro to process param version version to treat macro as set to 1 when processing very old macros otherwise leave as is return a gmap array usage macrotext gmap zoom 7 center 419023875391 width 600px height 400px control small type map maparray gmapparsemacro macrotext  gmap array the main map array is quite complex most of the features have a macro equivilent but some of the more powerful constructs do not the map array is processed and converted to a javascript object shapes are parsed by gmapshapesjs and loaded by shapeloaderstaticjs using the gmap array once you build a gmap array you can render it as a map using a theme function provided by gmap anything left out of your gmap array will be filled in with the default map settings which can be changed on the gmap settings page  see gmaparraydictionarytxt for explainations of each of the gmap array options a simple gmap array maparray1 array id mymap id attribute for the map width 100 map width in pixels or height 400px map height in pixels latitude 419023 map center latitude longitude 875391 map center longitude zoom 7 zoom level maptype map baselayer type controltype small size of map controls output1 theme gmap array settings maparray a more elaborate example maparray2 array id example maptype terrain width 400px height 400px latitude 12345 longitude 12345 zoom 4 align left controltype small mtc standard behavior array locpick false nodrag false nokeyboard true overview true scale true markers array array text first marker longitude 393739522204 latitude 815681648254 markername light blue array text second marker longitude 44205835001 latitude 703674316406 markername orange shapes array array type polygon style array 000000 3 25 ffff00 45 points array array 4366787161011749470675048828125 array 4343696596521823700927734375 array 43905808356157469202880859375 array 4451217617107105469796142578125 array 4366787161011749470675048828125 array type circle style array 000000 3 25 ffff00 45 radius 07622248729082767 center array 393739522204 815681648254 feeds array array url http earthquakeusgsgov eqcenter catalogs eqs7daym5xml markername red output2 theme gmap array settings maparray2  ', 0);
