(54, 'help', ' guide to the map array a gmap array is used to define and render a map inside php code this is useful for things like creating a map based on a database query or doing things that you can t do with a macro defaults for map attributes can be set on the gmap settings page  top level attributes these are all of the by default recognized keys for a map array you usually will only use a subset of them map array  id  map id used to associate a map with other controls  width  map width as a css dimension  height  map height as a css dimension usually px  latitude  map center latitude  longitude  map center longitude  zoom  zoom level  maxzoom  maximum zoom level for autozoom  extent  map bounds  maptype  initial baselayer type  controltype  size of map controls  align  css alignment for map div  mtc  map type control  baselayers  array enabled map baselayers  styles  array shape style definitions  behavior  array various map behavior flags  rmtcallback  remote callback for ahah info windows  markers  array array of markers to place on the map  shapes  array array of shapes to place on the map here is a description of the top level keys of the map array id values identifier string description a unique identifier used to distinguish a map from other maps on the page and as a key to tie controls to a map example mymap notes assign this if you are planning on using external controls with a map one will be automatically assigned if you don t specify an id width values css dimension string description width of map div in valid css dimensions generally pixels or percent example 100  height values css dimension string description height of map div in valid css dimensions generally pixels example 400px notes using a percentage for height will most likely lead to a buggy map google s javascript must be able to determine the actual height of the map div for proper operation latitude values latitude of map center in degrees decimal format float description map center point latitude as a signed float example 3936827914916013 notes cast to float if you are unsure what type your latitude variable is some parts of google maps do not operate correctly if latitude is passed as a string see extent if you wish to provide a bounding rectangle instead longitude values longitude of map center in degrees decimal format float description map center point longitude as a signed float example 815625 notes cast to float if you are unsure what type your latitude variable is some parts of google maps do not operate correctly if latitude is passed as a string see extent if you wish to provide a bounding rectangle instead zoom values 017 integer description initial map zoom level this may be modified after map load by the user autozoom etc example 7 notes 0 is the furthest out zoom level 17 is the closest up zoom level but is subject to change some areas do not have satellite data all the way to 17 you may want to stay zoomed out a few clicks see extent if you wish to provide a bounding rectangle instead maxzoom values 017 integer description sets the maximum level of zoom the autozoom behavior flag will zoom to useful to prevent singlemarker maps from zooming in too far example 7 notes  extent values array array float float array float float description initial bounding box for map the first inner array is the southwest corner the second inner array is the northeast corner all units are degrees decimal make sure to cast coordinate components to float as needed example array array 4319 10406 array 4601 9676 notes setting extent will cause the map to disregard latitude longitude and zoom the actual map extent may vary slightly from the requested extent due to the tiled zoom level based nature of google maps maptype values map satellite hybrid terrain string description initial baselayer of map the set of allowable baselayers can be extended see the gmapextrabaselayers in the gmapaddons project for examples of how to add additional baselayers example map notes the most common values are map and hybrid addon modules that add additional baselayers must use identfiers that won t conflict with other modules the four core maptypes are poorly named due to legacy macros  controltype values none micro small large string description set the pan zoom control type example small notes micro corresponds to gsmallzoomcontrol which only provides zoom control align values right left center string description sets the css alignment of the map div using classes provided by gmapcss example center notes the limited flexibility of align is a holdover from the early days if you need to position a map div more accurately consider using a mapid and targeting the div yourself with css mtc values none standard hier menu string description the map type control widget used to select different baselayers example standard notes standard buttons gmaptypecontrol widget hier buttons dropdown menu ghierarchicalmaptypecontrol widget menu dropdown menu gmenumaptypecontrol widget  baselayers values array string description enabled baselayers example array map satellite hybrid terrain notes the traditional set of baselayers is map satellite hybrid other modules such as gmapextrabaselayers from gmapaddons may provide additional possibilities the example shows the four core baselayers styles values array string array description an array of style names and definitions example array linedefault array 0000ff 54500 polydefault array 000000325 ff000045 green array 00ff00 5 100 notes currently linedefault and polydefault are predefined and apply to lines and filled polygons that do not have style information assigned you can override these two defaults on the map level if you wish see the shape style definition for more information on styles behavior values array string description map behavior flags any that aren t set on the map level will be inherited from the defaults example array autozoom overview notes there are several behavior flags recognized by gmapmodule and other modules may choose to add their own behavior flags as well all behavior flags recognized are documented on the gmap settings page  core behavior flags  locpick puts the map into locpick mode which is used to choose a coordinate using the map nodrag disables map dragging also disables keyboard shortcuts nokeyboard disables the keyboard handler arrow keys etc nomousezoom disables the ability to zoom with the mouse wheel autozoom enables automatic map bounds calculation based on the markers added to the map dynmarkers ensures the marker system is loaded use this if you will be dynamically adding markers to an empty map overview enables the miniature overview map in the bottom right corner collapsehack attempts to work around a resize bug when placing maps inside collapsible fieldsets this does not work in all themes scale adds a map scale legend to the map fatmarkers if enabled on a view this will cause the gmapviews code to serialize the views fields and pass it through the map object this is useful if you wish to use custom marker handling code since you can t currently use map arrays with gmap views only macros there s usually no point in setting it rmtcallback values base url of callback path string description this specifies the location that gmap needs to call the drupal site back at to retrieve the contents of an ahah info window example checkurl url my callback notes each marker can have a rmt parameter that determines what is appended to the path when making the callback this should be used to pass a unique identifier to your callback so you can retrieve the correct data markers values array array description an array of marker arrays to place on the map example array array options array text start longitude 12196 latitude 5813 markername route offset 0 array options array text finish longitude 12196 latitude 58523 markername route offset 1 notes there are three types of overlays you can place on a map markers shapes and feeds each of these classes is represented by a subarray in the gmap array this is not the only way to put markers on the map it is however the easiest way the markers specified here are loaded through the static marker loader you can also set arbitrary keys in the array they will be passed to the javascript side automatically shapes values array array description an array of shapes to place on the map the format of the shape arrays depends on the type example array array array type polygon points array array 0000 0000 first point array 0000 0000 second point array 0000 0000 third point style array ff0000 5 80 00ff00 60 array type circle center array 0000 0000 center coordinate of the circle radius 100 radius of the circle in kilometers style array style to use array type rpolygon center array 0000 0000 center coordinate of the regular polygon numpoints 4 number of vertices the polygon should have point2 array 0000 0000 one of the vertex coordinates style array style to use notes  overlays there are three types of overlays you can place on a map by default markers shapes and feeds each of these classes is represented by a subarray in the gmap array addon modules can add more types of overlays markers markers are point features on a map they are placed somewhere on the globe and can optionally be programmed to show an information window when clicked any additional keys values you put in a marker array will be passed to the javascript side automatically this is very useful when writing custom code marker array  latitude  0000 marker latitude  longitude  0000 marker longitude  markername  smileyface name of marker set to use  offset  0 offset in marker set  text  popup text ginfowindow contents  tabs  array tabbed ginfowindow contents  link  http googlecom use marker as hyperlink  rmt  argument to pass for rmt  opts  array use custom gmarkeroptions  options  array misc behavior modifications here is a description of the keys of a marker array latitude values latitude of point in degrees decimal format float description marker latitude as a signed float example 3936827914916013 notes cast to float if you are unsure what type your latitude variable is some parts of google maps do not operate correctly if latitude is passed as a string longitude values longitude of point in degrees decimal format float description marker longitude as a signed float example 815625 notes cast to float if you are unsure what type your latitude variable is some parts of google maps do not operate correctly if latitude is passed as a string markername values the name of the icon set to use string description marker icons are located in the gmap module s markers directory gmap reads the ini files to find available markers example light blue notes some markers have multiple icons use offset to choose which one to show offset values the index of the marker to use integer description for markernames with multiple icons you can choose which one to use example 0 notes the code will automatically wrap around if you simply increment offset every marker you do not need to know how many icons are actually assigned to the marker set text values html or text to show in info window on marker click string description this will set up an info window popup when you click the marker if you specify as a string it will make a regular ginfowindow if you specify as an array it will make a tabbed ginfowindow where the array keys are the tab titles and the array values are the contents of the tabs example point a notes anything put in here will be sent inline to the javascript side so if you are planning on using complex popups you may want to consider using rmt instead tabs values array description tab titles and html or text to show in info window on marker click example array name em united states em currency united states dollar notes anything put in here will be sent inline to the javascript side link values a url to go to when the marker is clicked string description this will program the marker to act like a hyperlink example http googlecom notes it is pointless to specify text or tabs at the same time as link as link causes immediate navigation away from the map rmt values path to append to the rmtcallback string description when using ahah markers this should be set to the identifiers expected by your callback example 150 notes if you need to pass multiple identifiers just seperate them with slashes opts values array description filling out this parameter will allow you to override the gmarkeroptions that a marker is initialized with the icon key is automatically filled in you can t set it here example array bouncy true notes the documentation for gmarkeroptions can be found here  options values array description this is used similar to how behavior works at the map level example array autoclick notes available options autoclick automatically causes a click event on this marker useful when you want to automatically show an info window shapes shapes are the non point features on the map shape array  type   points  array  center  array 00  radius  0  point2  array 00  numpoints  10  style  array  type values circle polygon rpolygon line string description determines how the shape is processed circles and rpolygons are converted into lines with javascript math example circle notes line is drawn as a gpolyline polygon is drawn as a gpolygon circle and rpolygon regular polygon are special cases of polygon  points values array array lat1 lon1 array lat2 lon2 array latn lonn description an array of points defining the shape used by the line and polygon types example array array 44205835001 703674316406 array 443159879052 686096191406 notes each point itself is an array with two elements latitude longitude the different shapes have different requirements with respect to points line must have at least two points it is best to break up long lines into shorter segments because long lines can be buggysometimes beginning and ending points are switched polygon should have at least three points the first and last points should have the same coordinates center values array lat lon description center point of circle or rpolygon  example array 44213 96411 notes  radius values float description the radius of the circle in km only used for the circle type example 100 notes big circles look more like ovals this is due to the mercator projection used by google maps point2 values array lat lon description the coordinate of a vertex on the rim of the rpolygon  only used for the rpolygon type example array 1266 5523 notes changing both the latitude and longitude in respect to the center point will make the polygon rotate  numpoints values integer description sets the number of points used to draw the circle or rpolygon  only used for the circle and rpolygon types example 20 notes don t use a very large number it will slow down the map drawing style values array stroke color stroke weight stroke opacity fill color fill opacity or string description a style array  or a key to the styles array on the map  this is the same format used for the map level styles array example array ff0000 5 80 00ff00 60 notes the elements of this array must be in the specified order stroke and fill colors should be hex color codes without the leading google maps does not accept named colors the stroke weight is the width of the line or polygon border in pixels stroke and fill opacities should be a percentage between 0 and 100 fill color and fill opacity are not used for type line if shapes of type line don t have styles defined the linedefault style will be used shapes of type polygon circle and rpolygon will use polydefalt in previous versions of gmap specifically all drupal 46 and 47 versions opacity was specified as a number between 0 and 1 it is now a number between 0 and 100 on backwards compatibility there were originally more style options but they were dependant on xmaps xmaps is no longer compatible with google maps so these options are now ignored they are pattern text fillcolor fillopacity all except for pattern are now available with different syntax using a map array  map array set up your map array output theme gmap array settings map  ', 0),
(55, 'help', ' extending gmap custom markers you can add custom markers to gmap by placing the marker images in the markers  directory and configuring the marker with an ini file you may wish to make your own folder to keep your markers seperate from the builtin markers an ini file defaults defaults the defaults section holds the settings that will be used if they are not specified on the marker shadow the filename of the image to use for the shadow of the marker anchorx 10 anchorx and anchory are the pixel coordinates relative to the top left corner of the image anchory 29 to define where the pushpin of the marker is infox 17 infox and infoy are the pixel coordinates relative to the top left corner of the image infoy 6 to define where the tail of a poppedup info window points to marker sets mycustom this is the internal name of the new marker type it s used in macros and when placing markers using php code name my custom this is the name that appears in the marker chooser dropdown sequence my1png my2png the list of image files to use specifying multiple filenames will let you have changing images when placing a series of markers the numbers marker is a good example files after creating your ini file be sure to go to the gmap settings page and click the regenerate button gmap hooks  todo  adding behavior flags  todo  javascript handlers  todo gmap uses a custom event system to pass data and events around extending gmap views  todo  ', 0),
(56, 'help', ' readme  id readmetxt v 1522 20090621 034303 sun exp summary jquery ui http uijquerycom is a set of cool widgets and effects that developers can use to add some pizazz to their modules this module is moreorless a utility module that should simply be required by other modules that depend on jquery ui being available it doesn t do anything on its own for a full description of the module visit the project page http drupalorg project jqueryui to submit bug reports and feature suggestions or to track changes http drupalorg project issues jqueryui requirements the jquery ui library installation copy the jqueryui module directory to your sites all modules directory download the latest jquery ui 16 development package from http codegooglecom p jqueryui downloads list can 3 q 16 extract it as a subdirectory called jqueryui in the jqueryui folder sites all modules jqueryui jqueryui enable the module at administer site building modules jquery ui 17 the jquery ui module uses jquery ui 16 because jquery ui 17 requires at least jquery 13 which is not shipped with drupal 6 if you absolutely need to move to jquery ui 17 you can get around this by doing the following install the jquery update module appropriately from http drupalorg project jqueryupdate download the latest jquery ui 17 development package from http codegooglecom p jqueryui downloads list can 3 q 17 replace the old jquery ui folder with the 17 package at sites all modules jqueryui jqueryui api developers who wish to use jquery ui effects in their modules need only make the following changes in your module s info file add the following line dependencies jqueryui this will force users to have the jquery ui module installed before they can enable your module in your module call the following function jqueryuiadd files for example jqueryuiadd array uidraggable uidroppable uisortable jqueryuiadd uisortable for a single file see the contents of the jqueryuixx subdirectory for a list of available files that may be included and see http uijquerycom docs for details on how to use them the required uicore file is automatically included as is effectscore if you include any effects files contact current maintainers jeff robbins jjeff angela byron webchick addison berry add1sun daniel f kudwien sun http drupalorg user 54136  ', 0),
(57, 'help', ' testing procedure gmap 1x location 3x tester checklist setup from scratch enable modules visit admin settings gmap and configure api key visit admin settings filters and set up a gmap filter visit admin content types and create if desired and locationenable a content type visit admin settings location geocoding and configure geocoding for a country visit admin user settings and configure the location fields section visit admin build block and enable the author map and location map blocks visit admin build block configure gmaplocation 1 and enable the author block for the content type you locationenabled tests 1 gmap macros visit map macro  play with the controls and ensure map responds play with map and ensure controls respond doodle on the map make sure drawing controls work as expected copy macro open another window tab create a node set filter to gmap filter and paste macro save node compare display of map to macro in other window tab tests 2 location user edit your user account add your location ensure geocoding works ensure the data is not lost when going back to edit tests 3 location nodes create a node with locative information ensure author map and location map display as expected advanced section stuff involving special setup or advanced knowledge advanced upgrade path create test site on location 27 perform tasks from setup from scratch section create or import test data install location 3 attempt to perform updates ensure in database that data was properly split off into locationinstance ensure site settings are in a sane state you should not get any misconfigurationrelated warnings errors visually inspect some locations on site advanced nonstandard usage disable gmap and create locative nodes ensure form continues to work in the absence of gmap  ', 0),
(58, 'help', ' country api note  this file describes the original country api while the api itself hasn t changed some things have moved in directions not forseen by this documentation for example there is less emphasis today on postal data and more emphasis on geocoding webservices please take this documentation with a grain of salt until it is fully cleaned up and brought up to date locationxxinc adding support for an unsupported country this file is a php programmer s description of what needs to be done in order to extend the location system to support locationes from a new country let s suppose we want to extend the location system to support locationes from belgium to this end there are 2 tasks task 1 we use the lowercase of the country s twoletter iso 3166 code to create a file locationbeinc that defines the necessary functions that will hook into the location system this way when a highlevel function in the public location api receives a call that uses some belgium specific function the call will be delegated to the appropriately named function in locationbeinc task 2 you need postal code data for your country this postal code data needs to be able to connect the baselength postal code eg us postal codes can be 9 digits but we re only interested to the level of 5 digits and most people only know the 5digit version to a city province state country duh and a latitude longitude pair in degrees that represents the approximate center of the postal code s area ultimately you will want to create a database dump that inserts these fields into specific columns zip for postal codes city for city names province for the standard state province country abbreviation country for the lowercase of the country s two letter iso code latitude for the latitude in degree value as opposed to radian value and longitude for the degree value of the longitude in a lot of countries this data costs money you cannot simply create a dump and then publish it on drupalorg unless the data is free to redistribute however if you are interested in buying this data from some vendor and using it on your own site you can do so but may have to acquire a new license for each seperate business or web site for which you wish to use postal code data if in fact you had to pay a fee or license for this data this postalcodetolat lon mapping is important if you want to enable locationbased proximity searches of anykind for addresses in a particular country the module will still work fine without it but will not be able to support searches based on postal codes contents of locationbeinc this file will need to implement a handful of functions with the parameters and return values described below it is possible to not implement all of these functions since the caller usually checks to see if the function exists before calling it but it may limit the number of features the location system will be able to support for your country for an example implementation of the functions described below see supported locationusinc function themelocationbe location hide param location an associative array location where street the street portion of the location additional additional street portion of the location city the city of the location province the province state or territory country lowercased twoletter iso code required postalcode the international postal code for this location required param hide an linear array where the values are the location fields to suppress in the themed display return a string of the themed location the entire location should be enclosed by dl class location dl tags the different lines of the location should be enclosed by dl dl tags the idea is to allow countryspecific files to change the display of an location from the default theming done in themelocation defined in locationinc function locationprovincelistbe returns an associative array where the keys are the alluppercase standard postal abbreviation for provinces territories and like subdivisions the values are the fully spelled names of the abbreviated names preferrably these will be sorted by the full name function locationmaplinkbe location returns a deeplink to an online mapping service eg yahoo maps mapquest or some other preferrably free service given a full partial location in the format described in public api document locationapitxt param location an associative array location where street the street portion of the location additional additional street portion of the location city the city of the location province the province state or territory country lowercased twoletter iso code required postalcode the international postal code for this location required return a url with encoded http get variables to a free onlinemapping service note url not html link null if there is not even enough information to generate even a semiuseful link useful may depend entirely on the mapping service you choose to link to you are advised to experiment usually a city province combination is enough as is a postal code by itself however some services get confused when all fields are supplied some mapping services will be unable to map a city province location while they can t do anything with a postal code while others map postal codes fine but can t do anything useful with a city province pair function locationmaplinkbeproviders returns an array of mapping services to which the generation of deeplinks is supported supported means that the function for that particular mapping service has been defined for example if the locationbeinc file for belgium has functions for taking a location and generating a deeplink to yahoo maps and google this function will return that list in an array that give additional info see locationusinc for an example return an associative array where the keys are single words no spaces that identify a function in the same file for returning a deep link for example yahoo means locationmaplinkbeyahoo google means locationmaplinkbegoogle the values are themselves associative arrays with 3 expected keys name the name of the mapping service in the case of yahoo it would be yahoo maps url the full url of the main page of the mapping service ie the home page tos the full url of the terms of service for the mapping service function locationmaplinkbedefaultproviders returns an array of default mapping services it may happen that the site administrator has not yet made it to the settings page for selecting mapping providers in this case we want to tell the location modules which one to use as defaults to help the site admin avoid being in violation of each mapping services s terms of service we return a linear array whose values are the appropriately selected keys in the array returned the locationmaplinkxxproviders function return a linear array with the oneword nospaced identifiers used to identify the mapping function these should only be for the mapping services with relatively lenient and permissive terms of service important for more information on how to add support for deeplinks you are encouraged to see the examples in modules location supported locationusinc if you need extra help please feel free to submit a question on the issues queue for this project at http drupalorg project issues location replies will be prompt function locationdrivingdirectionslinkbe locationa locationb returns a deeplink to an online mapping service eg yahoo maps mapquest or some other preferrably free service given full partial locationes depending on whether or not the parameter locationes are complete enough for the chosen service this function will return either a deeplink directly to the driving direction or will provide a deeplink to a partially prefilled form for driving directions on the site you choose to link to param locationa an associative array location where street the street portion of the location additional additional street portion of the location city the city of the location province the province state or territory country lowercased twoletter iso code required postalcode the international postal code for this location required param locationb an associative array location where street the street portion of the location additional additional street portion of the location city the city of the location province the province state or territory country lowercased twoletter iso code required postalcode the international postal code for this location required return a url not html link with http get variables tacked on to the end this url either points to a form for driving directions from locationa to locationb or a deeplink directly to the driving directions depending on how complete the locationes are function locationgetpostalcodedatabe location array param location an associative array location where street the street portion of the location additional additional street portion of the location city the city of the location province the province state or territory country lowercased twoletter iso code required postalcode the international postal code for this location required return an associative array where lat a floating point for the latitude of the approximate center of the postalcode in the given location lon a floating point for the longitude of the approximate center of the postal code in the given location city the most appropriate city name for the given postal code in location province the most appropriate province name for the given postal code in location returns null if the postal code doesn t make sense typically this function will pull out the latitude longitude of the approximate center of postal code in the given location parameter as well as other data the reason this can t be implemented at the noncountry specific level in locationinc is that postal codes may be submitted in varying formats of varying precision while postal codes for this country in the database table may all be in a particular format it is up to this country specific function to examine location postalcode and format it appropriately so that it matches with a postal code in the postal codes table this hook is meant to be a replacement for the locationgetlatlonroughxx hook described next function locationlatlonroughbe location array param location an associative array location where street the street portion of the location additional additional street portion of the location city the city of the location province the province state or territory country lowercased twoletter iso code required postalcode the international postal code for this location required return an associative array where lat a floating point for the latitude of the approximate center of the postalcode in the given location lon a floating point for the longitude of the approximate center of the postal code in the given location returns null if the postal code doesn t make sense typically this function will pull out the latitude longitude of the approximate center of postal code in the given location parameter function locationlatlonexactbe location array param location an associative array location where street the street portion of the location additional additional street portion of the location city the city of the location province the province state or territory country lowercased twoletter iso code required postalcode the international postal code for this location required return an associative array where lat a floating point for the latitude of the approximate center of the postalcode in the given location lon a floating point for the longitude of the approximate center of the postal code in the given location returns null if the postal code doesn t make sense typically this function will be implemented on top of a webservice for retrieving exact lat lon information for a full location this function is not a necessity but a sample implementation would be helpful for future users if not it can always be added on a supply and demand basis  ', 0),
(59, 'help', ' api variant reference changelog  location 30 and later provide a locationapivariant function to aid in allowing addon modules to support multiple releases even if there are incompatible changes api variant 1 start of api tracking based on location 30 api variant 2 locationdiff renamed to locationcalcdifference because diffmodule was trying to invoke it as a hook before call locationdiff now call locationcalcdifference  ', 0),
(60, 'help', ' readme  modal frame api module for drupal 6 id readmetxt v 11211 20100514 031039 markuspetrux exp original author markuspetrux http drupalorg user 39593 contents of this file overview requirements installation api reference overview this module provides an api to render an iframe within a modal dialog based on the jquery ui dialog plugin you should not install this module unless another module requires you to or you wish to use it for your own custom modules it is an alternative to popups api ajax dialogs 1 which implements its own library and api to manage popup dialogs on the other hand the modal frame api is based on the jquery ui dialog plugin and it is specially built to deal with iframe elements with very little effort and no particular ajax requirements for themers this module provides a default template for rendering child pages within modal frames modalframepagetplphp that can be copied to the theme directory and customized to suit the particular needs of the site it is also pretty easy to adapt the provided stylesheets to match the look of the site 1 http drupalorg project popups requirements jquery ui module with jquery ui library 17x http drupalorg project jqueryui note that you also need jquery 13x currently provided by the jquery update module 6x2x see http drupalorg project jqueryupdate the onbeforeunload api is not required but recommended it enhances synchronization of parent child windows http drupalorg project onbeforeunload the dirty forms module is not required but supported it warns users if they are about to close a modal dialog with unsaved changes http drupalorg project dirtyforms installation be sure to install all dependent modules copy all contents of this package to your modules directory preserving subdirectory structure go to administer site building modules to install module done api reference modal frame api is pretty simple but powerful at the same time the serverside api looks as follows modalframeparentjs adds the modal frame javascript and stylesheets to the parent page you should use this when you wish to use the clientside api to manage frames within a modal dialog modalframechildjs adds the modal frame javascript and stylesheets to the child page this is necessary for pages and or forms that are rendered within a modal frame modalframeclosedialog args when a form is rendered within a modal frame what we would call the child window you can use this function from your form submit handler to close the clientside dialog you can also give it arguments that will be passed to an optional onsubmit callback that you can provide when opening the modal frame from the parent window the clientside api looks as follows drupalmodalframeopen options use this method to open a modal frame the argument is a javascript object that may contain the following elements o url required the url of the page you wish to render within the modal frame note that this feature is restricted by browser security contexts so you can only open child pages from the same domain where the parent page is located o width and height optional the size in pixels of the dialog o autofit optional enabled by default this option activates an onresize handler that will automatically resize and center the modal frame whenever the browser window is resized or when the child document is fully loaded o draggable optional this option is enabled by default use false to disable o onopen optional this is a callback to invoke when the modal frame is opened o onload optional this is a callback to invoke when the the child document in the modal frame is fully loaded o onsubmit optional a function that will be called when the dialog is closed by the serverside response to a form submit request see modalframeclosedialog args o customdialogoptions optional an object with custom jquery ui dialog options there s also a close method and a few others but these are used internally you don t need to care about them just open a modal dialog and everything should be fine as long as the serverside menu callback invokes the function modalframechildjs when generating pages for the modal dialog the package also contains an optional module that can be used as an example it is also recommended to check out the inline code documentation as it has a lot of information on how it all works  ', 0),
(61, 'help', ' readme  id readmetxt v 112 20081015 183944 pwolanin exp readme file for the clone module for drupal 6x the clone module allows users to make a copy of an existing node and then edit that copy the authorship is set to the current user the menu and url aliases are reset and the localized words clone of are inserted into the title to remind you that you are not editing the original node users with the clone node or clone own nodes permission can utilize this functionality a new tab will appear on node pages with the word clone depending on the setting you choose there are two possible actions that will occur when you click that tab each of these is a different cloning method the default method used in the 5x2x branch also works by prepopulating the node form rather than immediately saving a copy of the original node to the database thus your node will not be saved until you hit submit just like if you went to node add x the alternative method that may be selected immediately saves the node by default the user must confirm this action on a confirmation form this may work better in some cases but also means that the copied node may immediately show up on the front page or in rss feeds even while you are editing it this module makes reasonable checks on access permissions a user cannot clone a node unless they can use the input format of that node and unless they have permission to create new nodes of that type based on a call to nodeaccess settings can be accessed at admin settings clone on this page you can set whether the publishing options are reset when making a clone of a node this is set for each node type individually this module seems to work with common node types however ymmv especially with nodes that have any sort of image or file attachments in all cases but especially if you are using a complex cck or custom node type you should evaluate this module on a test site with a copy of your database before attempting to use it on a live site on the settings page you may choose node types to be omitted from the cloning mechanism no users will be able to clone a node of an omitted type this module makes no attempt to respect fieldlevel permissions set via cck s content permissions module or any other module that implements cck fieldlevel permissions hooks you should test your configuration carefully or not allow access to the clone functionality for nonadmins if you rely on fieldlevel permissions for important site features to install this module copy the folder with all the files to the sites all modules or sites default modules directory of your drupal installation and enable it at admin build modules two new permissions are available but there are no changes to the database structure note this module originally derived from code posted by steve ringwood nevets drupal at http drupalorg node 73381 comment137714  ', 0),
(62, 'help', ' readme  id readmetxt v 18 20100322 012034 rdeboer exp description this modules forces new unpublished content as well as edits to current content to first go into a queue for review by a moderator publisher rather than immediately becoming live ie visible to the public we took our inspiration from the revision moderation module by angie byron but found that a patch could not implement the deviating functionality our customers required which would change the current behaviour of the rm module and surprise existing users in the rm module the permissions to edit and revert publish content are lumped together so that it isn t possible to enforce separation of these responsibilites by role this module allows you to assign distinct permissions for authors to only create and edit content and moderator roles to review publish revert unpublish and optionally delete content no unnessary revisions are created when saving a revision that is pending menu navigation has been altered so that users first pick the desired revision before being allowed to view edit publish revert unpublish or delete triggers are provided for the publish unpublish and revert events by taking advantage of the module grants module this module integrates better with the workflow and taxonomy access control lite modules this means that you can easily implement finegrained content access control based on categories as well as workflow states with revisioning installed this all works for both published and unpublished content there s also a publishpendingrevision action that may be triggered from a workflow state transition like in review publish unlike rm revisioning does not require any additional database tables installation 0 install the module grants module this is a package containing 4 modules although highly recommended the main module in this package is not required but the node tools submodule is module grants monitor is also recommended although revisioning features similar functionality through a canned view for which you ll naturally have to install views 1 optionally install the diff module if you want to compare revisions and highlight the differences 2 place the revisioning folder in your sites all modules directory enable revisioning under administer site building modules configuration 3 under administer content content types click edit next to the content types for which you wish to enable disable revisioning under workflow settings default options tick both the create new revision and new revision in draft pending moderation checkboxes also in this section untick published so that all new content is created in an unpubished state ie invisible to the public new revision in draft pending moderation means that when a user edits and saves a piece of content the new revision isn t automatically made current the previous copy remains unchanged and visible to the public until the newer revision is published in its place there is an additional radiobutton on the same page that augments the above behaviour giving you the option to only create a new revision when saving content that is not already in draft pending moderation this will save you some disk space because until the draft is published all modifications will be applied to the same copy ie no new revision is created when one already exists on the other hand there are situations for instance with a wiki page with multiple authors editing the same copy where you do want every save to create a new draft revision so that contributors can compare what was changed between saves the diff module is a good addition to revisioning for this 4 revisioning builds on the accessible content menu item if you have enabled module grants monitor adding the in draft pending publication filter to the double row of tabs 5 grant to the various roles the view delete revert revisions permissions node access section and the edit revisions permission revisioning section typically you d give authors the view revisions and edit revisions permissions while moderators will get the same as well as the publish revert revisions permission neither require the administer nodes permission which is a good thing as this gives ordinary users excessive rights usage you should now be in business log in as one of the authors and create content save log out then log in as a moderator to publish the content via the accessile content pending tab click on the title of the post then open the desired revision by clicking on the date check the content the press the publish link note that up to this point content isn t visible to the public log in as an author again and revise the content you will notice that upon saving the new revision the one visible to the public remains unchanged log in as a moderator again to promote publish after optional edits the revised content to live as an alternative to the accessible content menu item you may want to activate the pending revisions block this block is particularly useful for moderators as it constantly shows the latest content requiring moderator attention in an inobtrusive corner of the screen configure and enable the block like any other on the administer site building blocks page you can use this module in combination with tac or taclite for finegrained access control based on vocabularies such as region or department associated with the various content types be aware that any permissions given in the node module section override those granted via tac taclite so you probably only want to assign a few creation permissions in the node module and do the view update and delete grants via tac taclite in addition you may want to install the workflow module to further segragate the author and moderator roles via access control based on states such as in draft in review and live workflow also allows you to notify users when state transitions occur eg when a moderator declines or publishes a submitted revision stepbystep guides on the usage of the revisioning module in combination with the taclite and workflow modules can be found on the revisioning project page http drupalorg project revisioning author rik de boer melbourne australia inspired by the revision moderation module  ', 0),
(63, 'help', ' readme  id readmetxt v 12 20100512 203952 alexj exp drupal revisionall overview revision all allows for centralized management of content type revisioning revisioning can be turned on off individually by type or enabled for all simultaneously there is also support for enabling automatic revisioning of future content types and the removal of the create new revision checkbox on node forms installation copy the module files to your modules directory enable the module on the admin page admin build modules list configure revision all settings admin content revisionall note revision all won t make any settings changes until configured and saved credits contact this module was created by alex jarvis alexj at grrllibmnus sponsored by the great river regional library http wwwgriverorg  ', 0);
