(64, 'help', ' readme  node relationships id readmetxt v 11212 20100514 042329 markuspetrux exp original author markuspetrux http drupalorg user 39593 contents of this file overview requirements installation description developers credits overview the node relationships module provides methods to complete two way relationships between content types enhancing the features of node reference fields it provides the following features enhancements for node reference fields search and reference view single and multiple selection based on dynamically configured views create and reference and translate and reference when the drupal core translation module is enabled with additional support for internationalization module these features use the modal frame api to provide popup dialogs from buttons attached to node reference fields configured to use the autocomplete widget automatic back references using dynamically configured views that are able to extract the relations from existing database information this views can be rendered using a myriad of methods in the node view the node relationships module provides default views for each feature that can be modified and or cloned recommended should you need to add more fields filters or change any other option to suit your needs basic entity relations diagram erd that can be used to view the relations of each individual content type the provided diagram can be used to walk the relationships of all types in the system requirements cck and node reference http drupalorg project cck views http drupalorg project views modal frame api http drupalorg project modalframe jquery ui module with jquery ui library 17x http drupalorg project jqueryui installation be sure to install all dependent modules copy all contents of this package to your modules directory preserving subdirectory structure go to administer site building modules to install module review the settings of your nodereference fields to make sure related content types are explicitly specified in the option content types that can be referenced note that this is optional when you are using a view for your nodereference fields but this information is required by the node relationships module now you can start browsing the relationships tab available in the administration section of all content types next to the manage fields and display fields tabs provided by cck description the node relationships module provides methods to complete two way relationships between content types enhancing the features of node reference fields it provides the following features node reference extras this module provides several enhancements for node reference fields configured to use the autocomplete widget search and reference view create and reference translate and reference view referenced node on new window when these options are enabled a new button for each one will be rendered in the node edit form next to the corresponding autocomplete widget of the node reference field these buttons will open a popup dialog where each feature is available for nodereference fields defined with multiple values a new button will be available next to the add more items button that can be used to search and reference several nodes at a time the search and reference feature uses a view that is dynamically configured so that a single view can be reused by several node reference fields a default view is provided with basic fields and pages for table or grid styles you can modify and or clone recommended this default view to add more field filters etc a filter per node type is dynamically created to match the content types that can be referenced option in the global settings section of the node reference field note that you should configure this option explicitly even if you use a view for the node reference field the translate and reference feature is available when the drupal core translation module is enabled and additional support is provided when the internationalization module is enabled when the translate and reference option is enabled for a particular node reference field references that already have translations will be automatically assigned to the values of node reference fields when a node translation is started for those that do not have translations a message will be displayed on the create translation form to warn the user a translation is missing and an option to translate and reference will be provided automatic back references this module provides a method to display back reference views on referred nodes back reference definitions are taken from the content types that can be referenced option in the global settings section of node reference fields note that you should configure this option explicitly even if you use a view for the node reference field these back references do not need additional data stored in the database instead views with the proper relationships are used to join the node reference field data with the corresponding nodes in the database these views can then be used from the referred content types to provide a list of referrer nodes the node relationships module provides a default view that you can modify and or clone recommended should you need to add more fields filters or change any other option to suit your needs each back reference can be displayed using one of several methods to render the corresponding view in the referred node itself field page and tab field when a back reference is configured as a field the node relationships module creates a cck field automatically that provides the view output and you can drag n drop this view to any position from the manage fields panel of the content type note that no input widget is provided for this kind of fields only the view output is provided available field formatters back references view renders the customized view as usual back references count displays the count of back references page this method provides a fieldset where all back reference fields assigned to this region will be rendered this fieldset can be dragged to any position in the node using the manage fields panel of the content type tab this method provides an alternative to the page region but the back references are displayed on a new tab relationships added to the nodes where this option is enabled entity relations diagram this is a basic diagram of the relations of current content type with others referred from and refers to it can be used to walk the relationships of all types in the system this diagram is available per content type from administer content management content types type relationships developers aside from the options that can be configured for node reference fields back references views etc the node relationships module exposes a series of hooks that provide enhanced methods of programmatic configuration of the views and output generated todo document the hooks provided by the node relationships module credits this module has been sponsored by gamefilia http wwwgamefiliacom original versions of the icons can be found free from here http wwwfamfamfamcom  ', 0),
(65, 'help', ' readme  id readmetxt v 1724 20090715 195914 fago exp automatic nodetitle module by wolfgang ziegler nuppla zitesnet description this is a small and efficent module that allows hiding of the content title field in the form to prevent empty content title fields it sets the title to the content type name or to an configurable string if the token module is installled it s possible to use various content data for the autogenerated title eg use the text of a cck field advanced users can also provide some php code that is used for automatically generating an appropriate title installation optional download and install the token module copy the module s directory to your modules directory and activate the module for each content type you want to have an automatic title click on the edit link for it on admin content types at the top of the content type edit form there is a automatic title generation box allowing you to configure the details for the current content type advanced use php code you can access node from your php code look at this simple example which just adds the node s author as title advanced use combining tokens and php you can combine php evalution with the token module because tokens are replaced first however be aware to don t use this with any textual values provided by users as this would open a security hole if you are in doubt don t combine tokens with php evaluation here is an example so if the text of the cck number fieldtestnumber isn t empty it will be used as title otherwise the node type will be used updating nodetitles from existing nodes if you set the nodetitle to be auto generated for some content type existing nodes are not affected you can update existing nodes by going to admin content node then filter for your content type mark some nodes and choose the update option update automatic nodetitles  ', 0),
(66, 'help', ' readme  id conditional fields a drupal module author gregorio magini peterpoe http wwwwikirandomorg initially inspired by the explainfield module http drupalorg project explainfield short description content fields and groups visibility based on the values of user defined controlling fields description conditional fields allows you to assign fields with allowed values as controlling fields for other fields and groups when a field or group is controlled it will only be available for editing and displayed if the selected values of the controlling field match the trigger values assigned to it when editing a node the controlled fields are dynamically shown and hidden with javascript you can for example make a custom article teaser field that is shown only if a has teaser checkbox is checked dependencies drupal core 6x or 5x note that the 5x branch of conditional fields is very outdated while the 6x branch is actively maintained cck contentmodule http drupalorg project cck optional fieldgroups included in cck if enabled you can also set groups as controlled fields installation copy the unpacked folder conditionalfields in your modules folder usually basepath sites all module go to the modules administration page admin build modules and activate the module you will find it in the cck package assign the administer conditional fields permission to the desired user roles usage read the conditional fields handbook http drupalorg node 475488 limitations each field or group can be controlled from only one field though a field can control any number of fields and groups this will be corrected in later development if the controlling field is in a group it can only control or be controlled only by fields that are in the same group conditional fields for now supports only core cck fields and widgets checkbox select and radio as controlling fields fields from other modules might work but probably won t there are confirmed incompatibilities with many noncore cck modules date multigroup content taxonomy etc to do any help is welcome check the issue queue of this module for more information http drupalorg project issues conditionalfields these are the top priority future features extend compatibility with noncore cck modules negate conditions so that a field can be triggered when some allowed values are not selected allow multiple controlling fields on the same field views integration allow nested conditional fields  ', 0),
(67, 'help', ' readme  id readmetxt v 1161 20090419 213124 greggles exp description token module provides a centralized api for text substitution unless you re installing another drupal module that requires it this software is probably unnecessary for more information on tokens see http groupsdrupalorg tokens benefits if you re a drupal developer check out apitxt for detailed instructions on using the token api it allows every module to announce the placeholder tokens they can handle uses simple caching to prevent duplicated work in a given pageview and is pretty lightweight it s nice you ll like it tokenstarter want to add your own custom tokens to a site not sure how to write a module worry no more it s now quite easy 1 copy and rename the tokenstarterinfo and tokenstartermodule replacing every instance of starter with a descriptive appropriate word 2 edit the module file and change hooktokenlist and hooktokenvalues to provide whatever additional tokens or logic your site needs 3 enable the module and enjoy you should also want to read the apitxt ', 0),
(68, 'help', ' what is views  the views module allows administrators and site designers to create manage and display lists of content each list managed by the views module is known as a view and the output of a view is known as a display displays are provided in either block or page form and a single view may have multiple displays optional navigation aids including a system path and menu item can be set for each pagebased display of a view by default views may be created that list content a node view type content revisions a node revisions view type or users a user view type a view may be restricted to members of specific user roles and may be added edited or deleted at the views administration page the building block design of the views system provides power and flexibility allowing parameters to be specified only when needed while an advanced view may use all of available parameters to create complex and highly interactive applications a simple content listing may specify only a few options all views rely on a conceptual framework that includes  fields  or the individual pieces of data being displayed adding the fields node title   node type  and node post date to a node view for example includes the title content type and creation date in the displayed results relationships  or information about how data elements relate to one another if relationship data is available like that provided by a cck nodereference field items from a related node may be included in the view arguments  or additional parameters that dynamically refine the view results passed as part of the path adding an argument of node type to a node view with a path of content for example dynamically filters the displayed items by content type in this example shown with clean urls enabled accessing the view through the path  http wwwexamplecom content page  displays all posts of the type page the path  http wwwexamplecom content story  displays all posts of the type story and  http wwwexamplecom content  displays all posts regardless of type  sort criteria  which determine the order of items displayed in the view results adding the sort criteria node post date  in descending order to a node view  for example sorts the displayed posts in descending order by creation date filters  which limit items displayed in the results adding the filter node published  and setting it equal to published to a node view for example prevents unpublished items from being displayed displays  which control where the output will be seen every view has a default display which doesn t actually display the view anywhere but is used to hold the default settings for the view and is used when the view is called programmatically if another display is not specified much more useful to users are the page display which gives a view a path and allows it to be the primary content of a page or the block display which allows it to appear as secondary content on other pages  ', 0),
(69, 'help', ' getting started module developers the views api help pages can be found here  new users for those new to views it can be a complex system that appears totally overwhelming the good news is that the ui is designed to compartmentalize everything this means that for the most part you can ignore the parts you re not interested in start small and build your way up because of this the edit ui can seem overwhelming at first but there are really just a few things you have to know the rest you can find through exploration the views edit ui image below gives an overview of what you ll find on the edit ui the views edit ui notes 1 every view has a number of displays which represent where output will be placed if you re familiar with the original views 1 you could set a view to be a page with a url path or a block that could show up in a sidebar with views 2 you can add as many displays as you like in addition you have the default display which contains the basic settings but doesn t actually show up anywhere 2 when you click on the link for an item a form will open up for browsers with smaller resolutions you may have to scroll down a little to see this form if a form is open the item its attached to will be highlighted 3  overrides mean that a particular display is not using default settings when you create a new display many of its settings will start off using default values this will be indicated by italics and a lighter color if you change these values without first overriding them you will change the default value for all displays that use them 4 some items particularly styles have additional settings ordinarily when you update a style if it has additional settings you will automatically see that form next often you will need to go directly to those settings 5 you can safely leave a view page to go and do other things if you come back the view will still be there stored in a cache keep in mind however that while you do this that view is locked  meaning another user cannot edit this view without breaking the lock breaking the lock will discard your changes it helps to have something particular in mind that you want to accomplish when using views here are a couple of ideas and a brief sketch of how to accomplish what you want  ', 0),
(70, 'help', ' create a page to list users by role in this example you will create a page view listing users on your site through this stepbystep process you will become familiar with some basic steps in creating a view and familiarize yourself with the views user interface creating a new view go to add new view  give your new view the name userlist description a simple user listing tag users type user and click next  about the interface you have been brought to the views user interface as you start you are editing the default options for the view in the 1st column on the left you can see the dropdown menu offers block for example to select settings specific only to block views in the remaining columns you will be able to add or change options by clicking on links or icons these options will then appear below this main area most likely you will need to scroll to see the options appear as you make changes these options will appear in bold until you save your view creating a page display choosing a url and creating a menu link in the 1st column ensure that page is selected in the dropdown menu and click add display  next we ll define the path for this page a page must have a path and we define it early so that views doesn t warn us display page uses path but path is undefined locate the page settings in the 2nd column and click the none link next to the path setting in the options editing area that appears below set the path to userlist or something else if you prefer and click update  next to menu setting click the no menu link in the options which appear below select normal menu entry  and set the title to user list and click update  scroll up to basic settings  in that same 2nd column and click the no link next to use pager  below in the options select full pager and click update default display  selecting the fields to display in 3rd column locate the fields options click the   icon to add fields scroll down to defaults add fields  in the groups dropdown menu select user then check the following fields  user created date   user delete link   user edit link   user last access   user name and user picture  then click add  you will be taken through the fields you added one at a time click update default display to go to each next field leave the default options on all fields except delete link  change that field s label to operations scroll back up to fields and click the  uarr darr  icon to rearrange fields down below drag the name field by dragging its foursided arrow to the top drag the delete link operations  field to the bottom and the edit link field just above it then click update  seeing what we ve done so far at this point you have done enough to create a valid view if you scroll down you will see a preview of your view if it doesn t show already click the preview button but generally this display updates automatically whenever you finish working in one of the mini forms styling the view as a table combining related fields into columns under basic settings  in the 1st column click the unformatted link next to the style setting in the options below under page how should this view be styled  choose table and click update default display  you will be taken to a page style options form to edit the table settings locate our edit link field in this mini form and notice the column dropdown change this dropdown to show operations  in the separator column next to the operations field type note the spaces around the   symbol check all of the sortable checkboxes and set default sort to name  when finished click update default display  filtering the user list to exclude unwanted entries click the   icon next to filters  in the groups dropdown menu select user then check the user name filter and click add  select is not one of and enter anonymous in the usernames box click update default display  adding an argument to list users by role dynamically scroll up to arguments  and click its   icon check the user roles argument and click add  set the title to 1 don t type the quotes and under action to take if argument is not present select summary sorted ascending  leave the other settings as they are click update default display  and click update through the prompts that follow to accept their default values saving the view finally click the save button to save your work at the very top click view page  to go to your new view  ', 0),
(71, 'help', ' create a block of recent stories in this example you will create a list of nodes of the content type story to be shown in a block through this stepbystep process you will become familiar with some basic steps in creating a view and familiarize yourself with the views user interface creating a new view go to add new view  give your new view the name recentstories description recent stories tag story type node and click next  about the interface you have been brought to views user interface as you start you are editing the default options for the view in the 1st column on the left you can see the dropdown menu offers block for example to select settings specific only to block views in the remaining columns you will be able to add or change options by clicking on links or icons these options will then appear below this main area most likely you will need to scroll a bit to see the options appear selecting the fields to display in 3rd column locate the fields options click the   icon to add fields scroll down to defaults add fields  in the groups dropdown menu select node then check the following two fields  node post date   node title  then click add  you will be taken through the fields you added one at a time make the changes specified below for the post date field delete the post date label change the date format to custom  and the custom date format to f j y g i a do not type the single quotes for the meaning of these letter codes click on the php docs link under that box to arrive at the explanation click update  for the title field delete the title label select link this field to its node click update  scroll back up to fields and click the  uarr darr  icon to rearrange fields drag the foursided arrow next to node title so that it appears above node post date  click update to save the new field order filtering to story nodes only click the   icon next to filters  in the groups dropdown menu select node then check the node published and node type filters and click add  select the published checkbox click update select is one of and check story in the node type field click update  sorting to show most recent first scroll up to sort criteria and click the   icon in the groups dropdown menu below select node then check node post date  and click add  alternatively you may instead check node last comment time  or node updated commented date  or node updated date  select descending sort order  click update  refining the basic settings in 1st column under basic settings locate these options  items to display setting click 10  change the 10 to 4 click update style setting click unformatted  change to list  click update  adding a block display for custom options in the dropdown on the left ensure that block is selected and click add display  under block settings  click the none link next to the admin setting change block block admin description to recent stories  saving the view click save to save your work instructing drupal to show the block finally you should tell drupal to show this block configure your block by going to admin build block  locate the block in the list it is labeled recent stories  place this block in a region and click save  you may click configure to set a different title to determine which roles can view the block and on which pages it appears if you want your block on the front page only enter front  ', 0),
(72, 'help', ' create an rss feed of user posts in this example you will create a feed display to show nodes by individual users dynamically selected through the url you will become familiar with the views 2 interface as well as learn how to use an argument to pull in a user name and use it in a dynamically created path a feed is a data format that places your site s content into a file that can be read and displayed by news reader programs when visiting a site you may notice a small rss transmission icon  whereby clicking on it you can subscribe to the site s most recent content this makes it easier for your visitors to keep up to date with your website you can also use this format to aggregate information into other sites for more information please watch a video from common craft about rss in plain english  note drupal automatically creates a feed for your website but you may want to create feeds with specific information in this case a list per user creating a new view go to add new view  give it the name userfeed description a feed of user nodes tag users type node and click next about the interface you have been brought to the views user interface as you start you are editing the default options for the view in the 1st column on the left you can see the pulldown menu offers feed for example to select settings specific only to rss views in the remaining columns you will be able to add or change options by clicking on links or icons these options appear below this main area most likely you will need to scroll to see the options appear as you make changes these options will appear in bold until you save your view change default display under basic settings in the 2nd column click row style fields a menu loads below  defaults how should each row in this view be styled  check the node option and click update  this loads another options menu  defaults row style options click update  create the rss view in the 1st column select feed in the dropdown menu and click add display  under basic settings in the 2nd column click row style missing style plugin note options appear below the views interface you may need to scroll to see feed how should each row in this view be styled tick node  then update this loads the next options menu display type  select use default rss settings click update  set the path for accessing your feed in the 2nd column under feed settings  click path none in options below feed the menu path or url of this view enter in the path with an argument feeds rssxml click update set up your arguments to say which user s nodes to display to the right of arguments  click the sign to add and argument in the feed add arguments menu that loads below select user in the pulldown menu check the box user name  click add scroll down to options to find case in path  select lower case check the box transform spaces to dashes in url click update default display sort to show most recent at top of feed scroll up to sort criteria in the right most column and click the icon in the groups dropdown menu below select node then check node post date  and click add  select descending sort order  click update  set filters to hide unpublished entries click the icon next to filters  in the options below select node under groups dropdown menu choose the node published filter and click add  check the box published  click update default display test click save under live preview type in the name of a user in lowercase replacing spaces with dashes click preview  you should test and find your feeds at urls like http yoursitecom feeds username rssxml you can use this path for aggregating on another site you can also attach the rss feed to another display of view to make the feed link appear on that display  ', 0),
(73, 'help', ' create a block of author s recent blog posts in this example you will create a contextsensitive block that shows the titles of recent blog entries by an author when viewing one of their posts this will demonstrate using views arguments to dynamically filter a view s contents at display time before working through this example enable the blog module and populate some entries from a few different users creating the view the first step is creating a view for our recent blog entries block because the block will show the titles of blog entries this view is considered a node type go to add new view  enter the following properties and click next  view name recentblogentries view description list of recent blog entries for a given author view tag blog view type node generating a list of blog entries it will be much easier to see the view progress if we can see it doing something in this section we will create a basic view displaying blog entry titles in the third column locate the fields area generally speaking fields are the pieces of information that you want to display in the view in this case node title click the   icon to add a field scroll down to defaults add fields  below the settings table a large selection of fields will be available in the groups dropdown menu select node  this will limit the list to only the default fields exposed by node module scroll down the list select the node title field and click add  you will now be presented with settings for the node title field delete the label from the label field so that each individual node title is not prefixed with the word title additionally check the link this field to its node box so that visitors who see an interesting title can click directly on it to read the blog entry to which it belongs when finished click update  if you scroll down to the live preview section you should now see a list of several node titles however both blog entries and other node types will be in the list let s fix that in the fourth column locate the filters area filters limit the results displayed in the view and we can use this to our advantage here by showing node titles only from blog entries and not every type of node click the   icon to add a filter as before scroll down to the defaults add filters section select node from the groups select box to limit the list of options to only those exposed by node module scroll down and select the node type field and click add  in the settings page that appears leave operator as is one of and select blog entry under node type  click update when finished now by scrolling down to live preview  you ll see that the list only shows blog entries adding context with arguments while filters are very useful for limiting the results of a view when the condition is always consistent for example a view of blog entry nodes should always be filtered by the blog entry type something filters can t do is smart decisionmaking based on the page context in our case we want the view to display a different list of blog entries when looking at a post by user admin than we do when looking at a post by user member and filters won t be able to help luckily there s another way to filter a view s content  arguments  through arguments views are able to obtain additional context typically via dynamic urls with ids in them and can take this context into consideration when displaying the view let s walk through adding and configuring an argument to our view so that we can change its contents based on post author in the third column locate the arguments area click the   icon to add an argument because we are basing the view around content authors  this time under groups select user  check user uid and click add  the defaults configure argument user uid settings page has a lot going on but only a few things that need our attention the title field here unlike the title field under basic settings  can be based upon the context that the view is being displayed in change the title to recent entries by 1 1 will later be expanded to the user s name based on the user uid argument when the view is displayed under action to take if argument is not present  there are a variety of options ranging from displaying a 404 or a 403 page to simply displaying all values in the view in our case if an argument isn t specified which it won t be since this view will be displayed in a sidebar block not as a page with its own url we want to give it a default one to act on select provide default argument  assuming javascript is enabled in your browser you should now get another selection for default argument type  select user id from url  which will then provide a new option  also look for a node and use the node author  select it this will cause views to first see if it can figure out a user id from the current url for example user 1 if it can t it will instead check to see if the current page is a node page such as node 42 and if so take the user id from the node s author field instead validator options provide a useful way to control what kind of arguments your view will accept select user as the validator  by default changing this setting will check the incoming argument and ensure it s a valid user id if not the view will be hidden from the page once you have changed the argument s title default argument and validator options click update to save your changes you ll notice that now the live preview no longer shows anything did we just break the view fortunately no it s merely abiding by our wishes to hide itself if there is no valid user id given to it try entering a 1 in the arguments box and clicking preview  you should now see a list of only user 1 s blog entries creating the block so the live preview is now showing basically what we want there s just one problem we have no way to stick what we ve done so far into a sidebar block let s fix that by adding a new display  in the first column under defaults  there is a select box containing entries such as page   feed  and yes  block  select block and click add display  there s not much else to do here as far as views is concerned under block settings  click the none link next to admin and fill in a description for the block in the administrative interface such as recent blog entries by author and click update  save your work by clicking the save button at the bottom of the views interface you should receive a message that the view has been saved next navigate to the blocks interface and drag the recent blog entries by author block to the right sidebar region or similar and click save blocks  you ll notice this appeared to do nothing no block shows in the sidebar but remember we are looking at an adminitrative page we are not looking at a page that would provide a user id context navigate to the main blog listing and click on an entry there you should now see a sidebar block titled something like recent entries by admin with a list of blog entries beneath it finishing touches there are still a few remaining things to do before our view is complete for example we said that the block was to show recent blog entries but instead it s showing them in the order they were entered with oldest on top additionally even unpublished entries are showing in the list currently return to the recentblogentries view edit page  add an additional filter by clicking the   icon in the filters section in the fourth column change groups to node and select node published  click add  under the published selection choose yes and click update  to handle sorting locate the sort criteria area just above filters and click the   icon there under groups  again select node  from the list of options check node post date and click add  in the settings page change sort order to descending  this will place the newer posts on top of the older ones click update when finished finally  save the view for your new settings to take effect  ', 0),
(74, 'help', ' view types the view type describes how this view is stored views is capable of having views entirely in code that are not in the database this allows modules to easily ship with views built in and it allows you to create a module to store your views for easy deployment between development and production servers normal normal views are stored in your database and are completely local to your system default default views are stored only in code and are not anywhere in your database they may be enabled or disabled but you may not completely remove them from your system you can override the view which will create a local copy of your view if you do this future updates to the version in code will not affect your view overridden overridden views are stored both in code and in the database while overridden the version that is in code is completely dormant if you revert the view the version in the database will be deleted and the version that is in code will once again be used you may store your views in code with the following procedure create a module to store the views add the function modulenameviewsdefaultviews  to this module export the view you wish to store in your module in code cut and paste that into the abovenamed function make sure the last line of the view is   views view name view  make sure the last line of the function is return views  after you make any changes be sure to clear the views cache  you may do this from the tools menu  ', 0),
(75, 'help', ' displays displays tell views where the output should go by adding a display to a view you can have your view appear as a page or as a block or even as an attachment to a different display on the view each display can have its own settings but when it s created a display will take all of its basic settings from the default display which all views must have for most settings there is an override button that will override that single setting for the current display overridden settings will have a mark in the summary for that display all default display settings are shown in the other displays  italic  when you override a setting than it is shown normal please keep in mind that when you are editing a setting on a display that is not overridden then by default you are editing that for all displays for fields   arguments   sorts   filters and relationships  you can only override all of them or none of them to do this click on the header for the filters or the rearrange button once you override the display will then have its own copies of the fields filters etc and changes to the defaults will not be reflected on your display ', 0),
(76, 'help', ' default display the default display is primarily a display to store settings and isn t actually used anywhere within the views system it is possible for external programs to use the default display but if they do they will hopefully tell you which display they will be working with the default display is also a convenient display to use to embed into your site using php snippets this is useful for example in node content but this is something that should generally only be done by administrators in general you probably want to add either a page display or a block display   ', 0),
(77, 'help', ' page display page displays have a path and an optional menu component page displays will be the primary content for the page meaning they will be displayed in the main content area when you visit the url that corresponds to the path page displays take their arguments from the url you can embed arguments into the url using in previous versions of views this was arg for example node foo will accept urls such as node 1 foo please remember that using a placeholder makes the argument required if you wish to have an optional argument simply omit the from the path ie using page as the path requires an argument and visiting http wwwexamplecom page will not trigger the view ', 0),
(78, 'help', ' block display block displays will show up on your blocks administration page once a block display is created and saved it can be enabled and positioned in your theme by visiting administer site building blocks and selecting it from the list blocks do not accept arguments from any source the only way to get arguments to a block is to provide defaults to it possibly via the php code default setting edit the argument in question you may want to override this argument if you have multiple displays using it change the action to take if argument is not present to provide default argument this will bring up a new box called provide default argument options the most common default argument type used for blocks is node from url where it attempts to determine if the url refers to a node for example if visiting node 1 or node 1 edit user id from url is also very common if you change the default argument type to php code note you must have permission to use php code on your site you can enter php to define the argument needed simply return the argument  ', 0),
(79, 'help', ' attachment display attachment displays are attached to another display in the same view when the display is visited the attached display will also be rendered and may be placed before after or both before and after the original display attachment displays are often useful for displaying an argument summary view along with a page display that accepts arguments this can be used to provide a kind of glossary ', 0),
(80, 'help', ' feed display a feed display allows you to attach an rss feed to a view  ', 0),
(81, 'help', ' arguments arguments are input while they often come from the url  they don t always so please don t be shocked when they don t each display type may have its own source for arguments block displays have no source of arguments at all they cannot pull arguments from the url and often require use of the default argument php code in order to get arguments the argument default plugins can be used to get arguments into a block view see provide default below in general arguments are used to filter the view and in that sense they have a very close relationship to filters but that isn t necessarily true for every argument arguments can be used for any purpose really the extent of what the argument does is up to the developer of the argument but the arguments that come with views are almost entirely filters a typical use of an argument might be to reduce a view to a single node a single user or nodes with a given taxonomy term action to take if argument is not present ignore the argument is removed from the view as though it weren t there and all results will be displayed hide view page not found the view will remove itself entirely if the argument is not present for a block this means it simply won t appear for page views the view will return a 404 and present a page not found error display empty text the value of the empty text will be displayed summary the view will attempt to display a summary of arguments available based upon the view and provide links to the view with those arguments summaries have their own style handlers as well as options the default summary style simply displays a list of arguments with a count of entries found per argument this special mode is a very powerful part of views provide default if no argument is given a default argument can be selected the method of choosing the default argument is selectable and pluggable wildcards all arguments have a wildcard which is an argument that means to use all values in practice it is the same as ignore above where the argument is simply removed and the view is created without the argument the wildcard title is used in titles and breadcrumb trails default arguments default argument selection is available only if the action to take is provide default   when that is selected a new fieldset will appear letting you choose what the default argument will be views provides the following default selectors by default but other modules may add more fixed entry you may directly enter what the argument will be this is not a variable it will always be the same argument node id from url this will attempt to find a node id from the url and is primarily useful for the node id argument though other arguments that use node ids such as the cck node reference argument will find it useful too for example when visiting the path node 1 or node 1 edit it will know that the 1 in that path is a node id and use it user id from url like node id from url this will attempt to find a user id from the path it also includes an option to look for a node and use the node author as the user id user id from logged in user you can use this to easily default a menu item to the logged in user for example if you created the path blogs and gave it a user id argument with this default blogs would go to the user s own blogs and blogs 1 would go to user id 1 s blogs please bear in mind that the selection of default argument happens only if an argument is not provided if using a display that has no argument source such as a block this will always be used however if using a display that reads arguments from the url this will happen only if the url did not contain an argument argument validation arguments can also have validators which are pluggable systems used to ensure that arguments fit within certain parameters when a validator is chosen it may provide some settings for the validator including the action to take if an argument is presented but it fails to validate these actions are generally the same as the default actions above excluding the ability to provide another default if a view provides a menu option such as a tab if the argument does not validate the tab will not appear this sytem can have other validators plugged in by default views provides basic validation ensures that the argument is present a php null value from eg php default argument code will invalidate node ensure that the argument is a valid node id you may select which types of node the validator will accept taxonomy term ensure that the argument is a valid taxonomy term this includes options to limit to specific vocabularies and can transform the argument to the right type depending upon the actual argument set the argument type option to the actual type of data that the argument being used is expecting php code you may enter arbitrary php code similar to the php block visibility code to determine if the argument is valid or not  ', 0),
(82, 'help', ' fields fields are the individual pieces of data being displayed adding the fields node title   node type  and node post date to a node view for example includes the title content type and creation date in the displayed results fields may not appear on every display because not all style plugins actually use fields for example the node row plugin simply displays the node through drupal s normal mechanisms and fields are not involved for the most part the field settings should be self explanatory fields will appear in the order that they are arranged in and they will usually appear with the label they are given ', 0),
(83, 'help', ' sorts sort criteria determine what order the records are retrieved from the database and displayed in generally all you need to do is pick a field and choose ascending 1 2 3 4 or descending 4 3 2 1 and it will be done if you have multiple sort criteria the second and later items only come into play if the first item is the same different data types sort just a little bit differently from others number fields number fields sort like you would expect 1 comes before 2 which comes before 10 which comes before 100 which comes before 200 etc text fields text fields always sort alphabetically even if the text contains numbers this can have some odd effects if you have numbers stored in text because the values 1 3 7 10 12 20 100 120 will sort like this 1 10 100 12 120 200 3 7 this is because these fields sort purely by characters and not numeric value ie comparing 200 and 3 the 2 comes before the 3 therefore 200 is smaller than 3 date fields date fields often can have a granularity which is a way of making similar dates actually be the same date take two dates that are close to each other  may 1 2007 530 am and may 1 2007 945am  without granularity the two dates are compared and the first date comes before the second date however if the granularity is set to day it only looks at the parts of the date up to the day  may 1 2007 and may 1 2007  at that point they are the same and the sort would move on to the next sort criterion  ', 0);
REPLACE INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(84, 'help', ' filters filters are used to reduce the data set that views provides that is to say without any filters applied views will return all of your content you don t want that so at least some filters must be used some very commonly used filters the node published filter is used to restrict a node view to only nodes that are are have the published box checked this can be very important to prevent users from viewing content they should not have access to the node promoted to front page filter can be used to show only nodes that have the promote to front page turned on the node type filter is useful for showing only certain types of nodes let s say you wanted users to see only nodes that were book nodes or a combination of book nodes and staffblog nodes this filter allows you to select exactly that the user current filter will show only nodes that the logged in user has authored the node post date filter can be used to show only nodes posted before after or between a range of dates the above list is only a tiny fraction of the filters available in views referenced here to give an idea of the kinds of tasks filters can accomplish  ', 0),
(85, 'help', ' relationships relationships allow you to expand the query to include objects other than the base query this is actually made more difficult to understand by the fact that views actually includes a few relationships by default and doesn t tell you they re there for historical reasons it would be inconvenient to remove these default relationships when relationships are present all fields including relationships will gain a new form item to let you select which relationship they will use they will default to using no relationship at all the main example of the relationship that is there by default is the node user relationship every node has an author and if a node is in the query the user who wrote that node is automatically made available note the author considers it an error that this relationship is automatic but by the time it was realized this was in error it was too late to change it a similar relationship that is not automatically made available is for node revisions each revision has its own author which is the user who made the revision by adding the node revision user relationship all of the user fields sorts filters and arguments available to a user will now be available for the revision author when a relationship is added to the view all applicable items will gain a relationship select box where you can choose which version of that particular item you wish to use this can be illustrated with an example a comment view contains the relationships comment node and comment user this means that all the fields for the node that a comment is attached to are available and all the user fields for that node author also become available the other relationship makes fields for the author of the comment available very often not the author of the node when you add the user name field you will be presented with a select box either the node relationship or the user relationship must be selected because there are two possible user names in the view to choose from another example of relationships involves the files table in drupal files are related to users but files are not necessarily related to nodes however the uploadmodule allows some files to be attached to nodes the only way for views to deal with this discrepancy is with relationships when creating a node view it s possible to add an uploaded files relationship to get file data for nodes that were attached with the upload module it is also possible to go the other way from a files view you may add a relationship via the upload table to view information about the node  ', 0),
(86, 'help', ' output styles view styles  the views  style system is how you customize the output produced by your view a view style is basically a smart theme template that processes the view data and then outputs it all styles in views can be overridden by placing copies of the templates in your theme directory and then modifying them see the theme information link available on all views to get hints for which templates a given view is using a breakdown of view output by default the style is unformatted  which means that there is very little style actually used the records are simply displayed one after another enclosed in a div tag so that you can use css to manipulate the view  some styles use a separate row style to determine how each row of the view looks this is useful for mixing and matching styles to more readily produce exactly the kind of output you need many styles can be grouped  for styles that can there will be a grouping field option pick one of the fields to group by this grouping field will be displayed as a header and all rows will be displayed beneath it with the theme developer module enabled the field grouping in views does not work disable the theme developer module before grouping by fields each style is its own entity  ', 0),
(87, 'help', ' view row styles a row style is an individual style to display only an individual record within a view for example a node type view would display one node per row a user type view would display one user per row some row styles use fields which means you select from the available fields to display others do not they are able to use the base type and create a display usually row styles that do not use fields produce less efficient slower views  so bear this in mind when contemplating the performance of your site ', 0),
(88, 'help', ' list output style the list view style will display every row of the view as part of an html list construct for example row 1 row 2 row 3 row 4 you may select whether or not the list is ordered which just means whether or not it uses numbers instead of the bullet row 1 row 2 row 3 row 4 the list style also uses a row style which means that it doesn t care what the actual output for each row of the view is if you need information about using css to style list views you may find this a list apart guide to styling lists useful ', 0),
(89, 'help', ' unformatted output style the unformatted output style simply places each row of the view one after another with no additional formatting  ', 0),
(90, 'help', ' table output style the table style will display the view results as a table each row of the table will correspond to a row from the view result when setting the table options each field in the view will be presented with some information next to each field  column by default each field is its own column however you can place multiple fields in the same column to do this pick which field you want to represent the column then pick another field and set the column value to that field you can place as many fields as you like in a single column but only the main field in a column can be clicksorted separator if you have multiple fields in the same column the separator will be placed between each one at the very least nbsp should be used as without the separator the fields will be placed very close to each other common separators are a bullet the symbol and a comma if there are no other fields in the column the separator will have no effect sortable if checked the header for the column will be clickable and the user may resort the table by clicking on this to sort by that field at this time views does not support clicksorting to sort by multiple columns at the same time default sort you may select a column which will be sorted by default when the table is first viewed this column will be highlighted to the user you may also select whether the default sort is ascending or descending  ', 0),
(91, 'help', ' grid output style the grid style will display each row of your view within a grid you may customize the number of columns though it defaults to 4 a grid looks like this row 1 row 2 row 3 row 4 row 5 row 6 row 7 row 8 row 9 row 10 row 11 row 12 row 13 row 14 row 15 row 16 the above uses the horizontal alignment where rows are added into the grid from left to right with a vertical alignment rows will be placed from top to bottom like this row 1 row 5 row 9 row 13 row 2 row 6 row 10 row 14 row 3 row 7 row 11 row 15 row 4 row 8 row 12 row 16 this style uses a row style to determine what each row will look like ', 0),
(92, 'help', ' rss output style the rss output style is only available for feed display types it will display the view as an rss feed which is a specialized xml output this output is not user visible but can be parsed by feed readers for aggregation you may supply a description for the rss feed most feed readers will display this description along with the contents of the feed you may also select to use the site s mission statement for the description ', 0),
(93, 'help', ' fields row style the fields row style displays each field defined in the view one after another each field defines its own output by default each field is put in a div unless it is selected to be inline  if it is inline it is put in a span two items in div s will be displayed one after another with the second one below the first two items in span s will be displayed on the same line one item in a span next to div s is the same as two items in div s this means that for the inline setting to do anything at least two consecutive items must be set inline you may define a separator which will be placed between each item this separator may be html you can use nbsp to print blank space ', 0),
(94, 'help', ' node row style the node row style will display each item of the view through drupal s standard nodeview  function views has very little control over this output except for the options you see instead the output is run through the standard node template mechanism typically nodetplphp or a variant thereof and any decisions about what is output may be done there views does add an extra suggestion to the list of possible node templates  nodeviewviewnametplphp  you may use this to theme a node specifically for the view this can be handy for creating very small teasers and the like you may opt to display the full node body or the node teaser and you may add the node links such as he comment links that appear after a node or not because of this behavior  the node row style does not utilize fields and the fields section will not be displayed please note that this row style performs a nodeload for every row and as such can produce a lot of extra queries sometimes this is necessary but it can have a negative impact on your site s performance  ', 0),
(95, 'help', ' node rss item row style this row style is only available to rss styles it produces xml necessary for an rss feed for the node record ', 0),
(96, 'help', ' comment rss item row style this row style is only available to rss styles it produces xml necessary for an rss feed for the comment ', 0),
(97, 'help', ' unformatted summary style the unformatted summary style is only available for summary styles which are when an argument has been set to provide a summary if it was not provided with a value this summary provides the possible candidates for the argument one after another with no special formatting if inline is selected the summary items will be enclosed within span tags otherwise the items will be in div tags you can also elect to display the number of matching records for the argument plus change the number of items per page for the summary this is often useful because summary views are often quite small but other views quite space intensive it is very common to have far more records available in the summary view than in the more normal view ', 0),
(98, 'help', ' list summary style the list summary style is only available for summary styles which are when an argument has been set to provide a summary if it was not provided with a value this summary provides a list of possible candidates for the argument in a standard html list like the normal list style you may set this list to be ordered or not you can also elect to display the number of matching records for the argument plus change the number of items per page for the summary this is often useful because summary views are often quite small but other views quite space intensive it is very common to have far more records available in the summary view than in the more normal view ', 0),
(99, 'help', ' menu options page display  page displays can hook into the drupal menu system and provide menu links that will appear in the navigation system as well as tabs that can be used to keep views next to each other for simple menu links  there is very little you need to do simply select normal menu entry and fill in the text for the title this will appear in the navigation menu by default you will need to visit the menu administration page to move this to another menu tabs are not quite so simple there are some complex rules for using tabs in drupal all tabs must have a parent which is the next level up in the path hierarchy for example if the view path is example taba then the parent must be example all tabs must have one and only one default tab this is usually the same content as the parent if a parent does not exist when creating the default tab views will allow you to also create a parent item it will automatically set up the url for you when it does this tab weight is used to control what order the tabs are displayed in lower numbers will display more to the left for tabs whose numbers are the same they will be displayed alphabetically drupal only supports 2 levels of tabs so be careful about trying to put tabs within tabs within tabs that won t work for example if you have two views that you want to be tabs you could set it up like this in the first view set the path to tabs tab1 set it to be the default tab set the title to tab 1 and the weight to 0 click update and you will be taken to a form that lets you define the parent since tabs doesn t already exist in the system select normal menu item and set the title to tabs on the second view set the path to tabs tab2 set it to be a menu tab and set the title to tab 2 with this done you will now have a navigation link named tabs and when you click on it you will go to the tabs with tab 1 being the default tab that appears you can then click between tab 1 and tab 2  ', 0),
(100, 'help', ' path options page display  if a display has a path that means that it can be retrieved directly by calling a url as a first class page on your drupal site any items after the path will be passed into the view as arguments for example if the path is foo bar and a user visits http wwwexamplecom foo bar baz beta  baz and beta will be given as arguments to the view these can be handled by adding items to the arguments section you may also use placeholders in your path to represent arguments that come in the middle for example the path node someview would expect the first argument to be the second part of the path for example  node 21 someview would have an argument of 21  note  views 1 used  arg for this kind of thing arg is no longer allowed as part of the path you must use instead if multiple displays within the same view have the same path the user will get the first display they have access to this means you can create successfuly less restricted displays in order to give administrators and privileged users different content at the same path ', 0),
