(101, 'help', ' theme information you may use any of the following possible theme files to modify individual parts of your view in total there are four parts to theming a view the display theme is usually viewsviewtplphp and it largely controls the decorations around a view where the header footer pager more link feed icon etc will be placed the style will control how all of the results of the display are put together it may be as simple as just displaying all of the rows or it may be a complex table generator or something in between the row style controls each individual row not all styles utilize the row style notably the table but most others do finally  field themes allow you to override the look and even the data of each individual field if the style uses fields the actual template the system will use should be hilighted in bold  a breakdown of view output the link to the left of each type will give you information about the default template used for that type you may cut and paste this and place it in your theme with the appropriate template or you may copy the base file from the views theme directory or if provided by a module from the module s directory  it is important that you clear the theme registry cache every time you add a new template or the new template will not be picked up important note  you place your custom template files in your theme directory  not views theme  this is always true of theming with drupal in addition to this tool the very useful devel module contains a tool called the theme developer which does a good job of visually showing you which areas of your site use which themes be careful with it though as the theme developer causes the views edit page to break also this feature will only work properly with drupal 63 and later prior to drupal 63 this patch will be required  ', 0),
(102, 'help', ' using views templates views theme templates are straightforward to use with the drupal theming system if you are unfamiliar with the theming system at all you should probably at least read drupalorg theming documentation  that said these are the important things you need to know copy a base views template to one of the names provided from the theme information section of the view copy this template right into your theme directory clear the theme registry see the instructions for how to do this your new template should now operate assuming you picked a nicely named template that includes the view name that template should now be active for your view a good example is viewsviewlistfoobartplphp which would work for a view named foobar you can now modify this template all you like for any template that uses fields the fields will be in array in order to use this effectively you will need to understand enough php to fetch data from an array this is a place where the devel module can really help you because you can use its dsm function right in your template to see what variables it uses there is an alternative to dsm that works without devel module but it s a bit longer to use for example i placed the following code inside a loop in viewsviewtablephpphp php drupalsetmessage pre varexport row true pre and it produced this output array nid 97 title scisco ideo vicis feugiat qui name luwrepuslan my view had three fields node nid node title user name the contents of the row variable included these fields in precisely the order that i had arranged them to using the views rearrange link also worth noting though is that each field also has an identifier so it can easily be pulled out of the row should i want to display it differently using php print row title would print just the title for that row please remember that i m doing this inside the loop so this will get repeated for every row of the view the ids used to fetch items from the array id  row title  can be quickly and easily looked up on the theme information page once a field has been added to the view its id will not change but note that if there are two title fields in a view one will be title and the other will be title1 in order to prevent namespace collisions the important thing here is that views does provide ids views doesn t tell you what these ids are but it s easy to get them by dumping the row data and doing a simple visual inspection views does guarantee that these ids will not change unless you actually add a new field and remove the existing one in which case title above would become title1  the basic fields template the most common template people will need to rewrite is the simple viewsviewfieldstplphp which is the template used by the fields row style and all it does is display a simple list of fields however it is not that simple to the user because the template can t inherently know what the fields are it has to go through an array in a loop this loop isn t very handy when you really want to have fine control over the template by placing your fields precisely where and how you want relax though if you know what your fields are you can rewrite this if you end up writing your own html the only part that is really important is the content for each field we know from above that you can get the id for each field on the theme information page from the view in the header for the template we can see that the fields are all in the fields array and each field is an object that leads us to this php print fields someid content assuming you replace someid with an id found on the theme information page this code will print the content for that field you can also get the label and some other data about the field as well as the raw information complete details for what is available are documented directly in viewsviewfieldstplphp keep in mind that if you rewrite your templates using this you ll need to maintain this template whenever changes are made to the fields of the view while this isn t generally recommend sometimes it s necessary to get the kind of control you might ultimately need  ', 0),
(103, 'help', ' using css with views views uses a wide array of css classes on all of its content to ensure that you can easily and accurately select exactly the content you need in order to manipulate it with css typically every view is wrapped in a div with the name of the view as part of its class for all these examples we will assume the name of the view is myview  as well as the generic class view div class view viewmyview div in your css you can modify all views divview border 1px solid black or just your view divviewmyview background yellow by default the general view template also provides the following classes to easily style other areas of the view viewheader viewfilters viewcontent viewempty if an empty text is used when the view has no results viewfooter feedicon attachmentbefore if using an attachment display attachmentafter if using an attachment display so for example divviewmyview divviewheader make the header stand out fontsize 120 fontweight bold divviewmyview divviewfooter make the footer less important fontsize 80 fontstyle italic color ccc in the above example we whimsically made the header bold and in a bigger font and the footer smaller italicized and greyish views with fields if your view has fields each field is uniquely tagged with its id a field s id may be gleaned from the theme information page note that due to css rules any in the id will be converted to automatically so if you have a field whose id is editnode this is the field used to provide an edit link to a node it will be editnode additionally to make sure that the view ids don t conflict with other css classes in the system they will be pretended with viewsfield thus the final css class for the field with the id editnode will be viewsfieldeditnode  exactly how this appears is going to depend upon the style you re using for example the unformatted style uses divviewsfieldeditnode and divviewslabeleditnode to access that particular field but a table would use tdviewsfieldeditnode and thviewsfieldeditnode to access the table header or just viewsfieldeditnode to affect both viewmyview th color red make all headers red viewmyview viewsfieldtitle fontweight bold make the title field bold viewmyview tdviewsfieldbody fontsize 60 make the text in the body field small  ', 0),
(104, 'help', ' what are overrides  if an item is using defaults then it is using values from the default display  important note  if you modify this value you are modifying the default display and thus modifying for all displays that are using default values if that is not what you intend you must click the override button once overridden that display now has its own version of the value modifying it will not modify it for other displays for relationships   arguments   fields   sort criteria  and filters  each of these must be overridden as a group in other words you cannot override a single filter but instead must override all filters a message will appear on the item to let you know what its status is but you can only change the status by clicking on the header or the rearrange button for that item  ', 0),
(105, 'help', ' embedding a view into other parts of your site you can easily embed the results of a view into other parts of your site either with code as a module or in nodes or blocks as snippets the easiest way is to use the function viewsembedview   embed a view using a php snippet this function is meant to be called from php snippets should one wish to embed a view in a node or something it s meant to provide the simplest solution and doesn t really offer a lot of options but breaking the function apart is pretty easy and this provides a worthwhile guide to doing so param name the name of the view to embed param displayid the display id to embed if unsure use default as it will always be valid but things like page or block should work here param any additional parameters will be passed as arguments function viewsembedview name displayid default to figure out the id of a display hover your mouse over the tab to select that display everything after the viewstab is the id of that display this id is guaranteed never to change unless you delete the display and create a new one  ', 0),
(106, 'help', ' what s new in views 2 views 2 is the newest major release of views and it is specifically coded for drupal 6 views 2 retains all of the core functionality of views 1 together with a completely revamped user interface and a large set of new features which greatly expand upon the original featureset of views 1 this document is a sidebyside comparison of views 1 versus views 2 from a user s perspective detailing the ui changes some new ways to perform old tasks the cool new features of views 2 and how these features can be used to address some of the shortcomings of views 1 admin interface the first thing that pops out after you install views 2 is the radically different admin interface  views 2 admin interface compared to the old comfy views 1 interface  views 1 admin interface the new admin interface performs the same functions as the old listing all the views in the system providing links to add or import views and a link to views tools but has been compacted with each view displayed as a paragraph stylerow compared to the table of views 1 and set of filters on top to ease locating views among a large list contexthelp is available by clicking the small blue questionmark icon contexthelp in views 2 is provided by the advanced help module so make sure to install that together with installing views 2 the small blue help icons will be available in various parts of the views ui in particular look for them as part of the description of a display  when setting style options and in various editing sections such as path   menu and the like several new attributes of each view are visible in the filter header  tag  this is just another label for organizing and sorting views tags can be any text views that are provided by modules will often be tagged together to make it easy to find them display  in views 1 each view query was tied to its display in other words your fields sorts filters and arguments could only be displayed in the single page or block display provided in the view definition in views 2 view displays have been decoupled from view queries it is now possible to have multiple page block and feed displays from a single view more on view displays later type  views 2 view types are radically different from views 1 types views 1 types basically defined how the node list displays were styled  you had full nodes teaser list table view and so on in views 2 view display styles have been broken out into the separate style attribute view types now refer to the primary table on which information for the query will be retrieved which controls what arguments fields sort criteria and filters are available views 2 view types are discussed later adding a view so let s jump in and add a view for this example we re going to create a user view which will display a list of users adding a view the first step in adding a view is simply entering a name only alphanumeric characters no spaces a description tag and the view type to get the user view we selected the user radio button configuring the new view this might be the 2nd whoa moment as the interface here is also completely revamped from views 1x the best way to summarize is to say all the pieces from the views 1x interface are still therejust in different places fields arguments sort critera and filters are all still there there just in new ajaxyflavours let s start by adding some fields  adding fields clicking on the icon next to the word fields unfurls a section beneath the view information with all the available fields grouped by comment file node node revision taxonomy and user and probably a few others this is a general paradigm for the views 2 interface clicking on a widget or link unfurls a section beneath the view information with the relevant interface usually what is being edited will be hilited in yellow as well when adding items you can use the groups dropdown box to show only a subset of the fields available according to the above groups or select all to see all fields available which is what was selected when the section unfurled for our example we re selecting the user group and adding the user email   user name and user picture fields adding fields once we add our fields they show up in the fields section of the interface we will be walked through each field we added so keep clicking update  even if you don t make changes to the field and you will see the next one the fields we added can be rearranged by clicking the up down icon right next to the add icon we used earlier we can also remove a field using the same interface rearranging fields from here the fields can be dragged up and down by grabbing the little drag handle on the left and moving them where you like making a change to any part of the view by clicking update usually triggers a refresh of the view preview which is conveniently located right below the main interface views preview now that we have some fields set up we can turn our attention to basic settings for the view it s important to note that all the interface elements pertain to the current display selected for the view as mentioned before a view can have multiple displays the first time you create a view you ll be manipulating the default display you can add displays using the add display button whose basic settings are completely different from each other this lets you have as many displays of a view as you would like all sharing items such as sort criteria filters and arguments but different display settings like title style fields and pager settings also any display you add automatically inherits display settings from the default display initially so you can keep a core of common settings in your default display and add additional settings for every other display adding a page display let s stick with the default display and twiddle some settings we can set the title to user view 1 and the style to table as mentioned earlier view styles in views 2 correspond more to view types in views 1 remember list table teasers full nodes  selecting a views 1 view type in views 2 view styles control how a view display looks these styles are significantly different from the types in views 1 in particular types have been broken up there is now the style as well as the row style which focus on different parts of the output a breakdown of view output we change the style by clicking on the current style on the left hand side of the view information area selecting a views 2 display style we re given the style options of grid   list   table and unformatted  additional display styles can be added by modules which have views style plugins  choosing a style reveals a settings button which you can click to configure the style you ve chosen in the shot below we ve selected and are configuring the table style which we re using to produce a more compact output than we had earlier selecting and configuring the table style  todo finish this document  ', 0),
(107, 'help', ' updating your views from views 1 to views 2 todo this document needs to be fleshed out  ', 0),
(108, 'help', ' views api views allows modules to describe their tables relationships to each other as well as fields filters sort criteria and arguments via hookviewsdata   whenever views deems it necessary this hook is called the data aggregated together and cached hookviewsdataalter  may also be used to modify existing data changing other module s handlers or adding handlers to other module s tables views also allows modules to create new display types style types row styles argument default handlers and argument validators via hookviewshandlers  and hookviewsplugins   these hooks are kept in a file named modulenameviewsinc this file is automatically included upon need so there is no need to try and include this in hookinit or any other method of including inc files this file should store hookviewsdata hookviewsdataalter hookviewsplugins hookviewshandlers as well as any other hooks and subsidiary data that will only be used by your module when views is active all handlers and plugins provided by your module should be in separate inc files there are two similar files modulenameviewsdefaultinc and modulenameviewsconvertinc which contain default views and views 1 to views 2 convert helpers respectively hookviewsapi  in order for your files to be included your module must first implement hookviewsapi  in the main module file this module should return array of information the following items may be returned  api this must appear it should be the oldest api version that your module can work with if views is currently running an older version of the api it will ignore your module s views integration this is a good thing as it will prevent code crashes at the expense of your module s functionality disappearing you may find the current views api version by calling viewsapiversion  which is implemented at the top of viewsmodule this version numbering starts at 20 every time changes are made to the views handlers and plugins or other aspects of the views api the number will tick up by either 001 01 1 or 1 depending upon how major the changes are note that viewsapiversion  was introduced in views 20rc2 and may not exist prior to that version you may use functionexists to test to see if this function is there often these versions are basically compatible with each other and views won t care if your module implements 2000 2001 2002 etc your module can request that it won t work with any version older than a given version however views will determine itself if a newer version will work path if your views inc files are not in the same directory as the module file then return the full path here you should probably use something like drupalgetpath module yourmodulename includepath  ', 0),
(109, 'help', ' describing tables to views tables are described to views via hookviewsdata which returns an array of table information keyed by the name of the table for example if your module is describing three tables foo bar and baz your array will look like this data array foo array info here bar array info here baz array info here the key should be the actual database name of the table not including prefix but it can be an alias as long as the join information explained later contains the real name of the table each item in the array should be a field in the table with the exception of a special information section called table example data foo array table array info about the table described later bar array info about the field named bar ie foobar baz array info about the field named baz ie foobaz once you get down to an array that contains actual data that piece of the array will often be referred to as the definition the table section each table should have a table section in it which is used to set default information for the table such as the group as well as the very important joins and whether or not this is a base table first there are several items that are actually for fields but can be placed here so that all fields within the table inherit them group the name of the group this item will be with in the ui this is displayed as group title for example node node id taxonomy term description etc it is important to be consistent with groups because the ui sorts by group and allows filtering by group to find fields as well title the actual name of the field it should be concise and descriptive help a longer description to help describe what the field is or does it should try to be only a line or two so as not to clutter the ui in general having title and help at the table level doesn t make a lot of sense but usually every item in a table is in the same group thus it is very common to define the group data foo table group t foo  base table if your table is a base table meaning it can be the primary central table for a view to use you can declare it to be a base table this primarily provides ui information so that it can be selected for example advertise this table as a possible base table data node table base array field nid title t node help t nodes are a drupal site s primary content weight 10 the following tags are available in the field the primary key field for this table for views to treat any table as a base table it must have a primary field for node this is the nid for users this is the uid etc without a single primary key field ie not a composite key views will not be able to utilize the table as a base table if your table does not have a primary key field it is not too difficult to just add a serial field to it usually title the title of this table in the ui it should be singular and describe the object that this table contains from the perspective of the user help a short piece of text to describe what object this table contains database if this table is held in a different database from your drupal database specify it as a string in the exact same format as the settingsphp file this is a special purpose variable that will probably be only used in site specific code and it must be the same database type as your drupal database  also don t try to join it to any table that isn t in the same database that ll just create all kinds of silly errors for example in settingsphp for your site your drupal site database needs to be called default dburl default mysqli user pass host drupaldb dburl budget mysqli user pass host otherdb then when you are describing the external database in your base table you would write something like this data table table base array field primary key title t field name help t field description database budget weight 10  linking your table to existing base tables for views to use your table it has to either be a base table or know how to link to an existing base table or sometimes both views uses this information to create a path to the base table when the table is added to the query views will walk along this path adding all tables required into the query how termdata joins to node in the above example to use these with node as the base table both termdata and termnode need to be defined and they each need a join handler for node data termdata table join node array lefttable termnode leftfield tid field tid the above can be read as in order to join to the node table the termdata table must first link to the termnode table and they join on the tid field when adding this table to the query for a node view views will look at this and then look for the termnode table data termnode table join node array leftfield nid field nid above the fact that lefttable is left out lets us know that termnode links directly to the node table using the nid field on both sides of the join quite a few more fields are available in this definition handler the name of the handler object to use defaults to viewsjoin you may create custom join handlers that may or may not use any of the data below as they see fit table table to join this is optional and should only be used if the table being referenced is an alias field field to join on this is required lefttable the next step toward the final destination if this is the final destination it may be omitted leftfield the field to join to on the left side this is required type either left default or inner extra either a string that s directly added or an array of items each item is itself an array field field or formula operator similar to filters this is the operator such as etc defaults to or in value must be set if an array operator will be defaulted to in numeric if true the value will not be surrounded in quotes and d will be used for its placeholder extra type how all the extras will be combined either and or or defaults to and describing fields on tables aside from the special table tag each table can also have an unlimited number of field designations these correspond roughly to fields on the table though it is very common to use nonfields to display data that isn t directly in a field such as data arrived from formulae or special links related to the object the table is part of each field is described in the view data with an array keyed to the database name of the field this array may contain some information fields plus an entry in each of the five types of items views has per field argument field filter relationship sort for example data node nid array title t nid help t the node id of the node the help that appears on the ui information for displaying the nid field array handler viewshandlerfieldnode click sortable true information for accepting a nid as an argument argument array handler viewshandlerargumentnodenid name field title the field to display in the summary numeric true validate type nid information for accepting a nid as a filter filter array handler viewshandlerfilternumeric information for sorting on a nid sort array handler viewshandlersort the above example describes the nid field on the node table providing 4 of the 5 handlers note that while field is normally expected to be the database name of the field it doesn t have to be you can use an alias which is how you get multiple handlers per field or something completely made up for items that aren t tied to the database for example data node editnode array field array title t edit link help t provide a simple link to edit the node handler viewshandlerfieldnodelinkedit the above handler definition an edit link to a node but this isn t a field in and of itself for aliased fields here is another example data users uidcurrent array real field uid title t current help t filter the view to the currently logged in user filter array handler viewshandlerfilterusercurrent the above definition provides an alternate filter handler on the uid field for the current user the following items are allowed in the field definition group title help as above these fields are for the ui if placed here any of these fields will override a setting on the base table real field if this field is an alias the real field may be placed here and the handler will never know the difference field a handler definition for the field section which is a field that may be displayed in a view the definition is an array the contents of the array are completely up to the handler other than the handler definition if omitted handler will default to viewshandlerfield filter a handler definition for the filters section which will be used to apply where clauses to the view the definition is an array the contents of the array are completely up to the handler other than the handler definition if omitted handler will default to viewshandlerfilter sort a handler definition for the sort criteria section which will be used to add an order by clause to the view the definition is an array the contents of the array are completely up to the handler other than the handler definition if omitted handler will default to viewshandlersort relationship a handler definition for the field section which is a way to bring in new or alternative base tables in the view the definition is an array the contents of the array are completely up to the handler other than the handler definition if omitted handler will default to viewshandlerrelationship the basic relationship handler requires base and base field to be set base and base field represent the right half of the join that will use this field as the left side argument a handler definition for the field section which is method of accepting user input from the url or some other source the definition is an array the contents of the array are completely up to the handler other than the handler definition if omitted handler will default to viewshandlerargument for more information about what handlers need use what data visit the views api site and check out the available handlers  ', 0);
