(110, 'help', ' using default views in your module views can be stored in the database which is typical of smaller sites and hobby sites however views may also be stored directly in the code as default views which simply means they re available by default modules often come with views that are specific to the module data but it s also possible and highly recommended that sites which have separate development and production sites export their views into default views in a sitespecific module this makes it very easy to transfer views from dev to production without making database changes creating a module first create a directory in sites all modules for your new module call it whatever you like but for this example we will call it mymodule  in this directory create a mymodulemodule file it can be empty for now but it should at least contain an opening php tag php id it should not contain a closing tag as the closing tag is not required and anything after the closing tag such as a space or a linefeed will be displayed directly to the browser and can potentially cause problems the module file will contain functions and drupal hooks hooks are specially named functions that drupal will call in order to get your module s response at certain times while generating pages the only function you will need for this exercise is the viewsapi hook that tells views that this module supports the views api and what version function mymoduleviewsapi return array api 20 for other uses you may well add additional functions second you need to create a mymoduleinfo file id name my module description my site specific module core 6x once you have these two files set up you should be able to activate your new module at the administer site building modules page exporting your views the easiest way to do this is to activate the viewsexport module and navigate to administer views tools bulk export place a check next to each view that you want in your module type the module name into the text field and click export this will create the entire hookviewsdefaultviews  function for you you can also export individual views if you do this keep in mind that this export does not include the line that adds the exported view into the larger views array views view name view to place this into your hookviewsdefaultviews  you will need to place that after the view and make sure the function returns views at the end placing your exported views into your module cut and paste the entire output of the bulk export tool into mymoduleviewsdefaultinc and be sure to put a php at the top of the file so that the webserver knows that it s php code then visit the views tools page and clear the views cache your views should now be listed as overridden on the view list page if you revert these views they will be removed from the database but will remain in code theming your views in your module you can theme these views in the module and not need to rely on the theme to do this at all and in fact the theme can continue to override these just like it ordinarily would even if your module provides a theme this is very useful for distributing a module where the view needs to look just so to do this you need to implement hooktheme  in your module function mymoduletheme existing return array viewsviewviewnamedisplayid array arguments array view null template viewsviewviewnamedisplayid original hook viewsview path drupalgetpath module mymodule there are a small number of gotchas in doing this that you must be aware of when referring to a template filename you always use dashes in the name ie  viewsviewviewnamedisplayidtplphp  however when referring to the hook or function names you use underscores instead of dashes ie  viewsview and viewsviewviewnamedisplayid the arguments change based upon which of the 3 types you re overriding there s the display the style and the row style the above code is assuming the display which is usually just viewsview  here are the possibilities display array view null style array view null options null rows null title null row style array view null options null row null be sure to use the right arguments line or the theme system will not properly translate the template line should never include the extension so drop the tplphp from it you need to make sure that the views preprocess functions get registered the original hook line in the definition does that but it can only do it if it comes after the views registration which actually happens very late in theme building 99 of the time your module will come before views you have two choices to deal with this set your module s weight to 11 or higher in the database views weight is 10 you can make this happen automatically when the module is first installed by creating a mymoduleinstall file and using this code function mymoduleinstall dbquery update system set weight 11 where name mymodule if you use this method the original hook should be set to the name of the original template being used ie if this is a variate of viewsviewlisttplphp this should be viewsviewlist you can also just force it to list the preprocessors without actually having to detect them this doesn t require modifying your module s weight which is not always possible you can insert this code into the array preprocess functions array templatepreprocess templatepreprocessviewsview mymodulepreprocessviewsviewviewnamedisplayid the first one is the global templatepreprocess function which all templates utilize it does some basic things such as setting up zebra and a few other items see apidrupalorg for specifics the second one is the plugin specific preprocess like original hook it should conform to the name used by the original template ie if the original template was viewsviewlisttplphp then that preprocess function would be named templatepreprocessviewsviewlist  the third one is your module s preprocess function if it needs one in general you probably will not need one and you should only attempt to use one if you are reasonably familiar with the concept of preprocess functions and drupal s theme system in general see drupal s theme documentation for more information if you leave the path blank the template file will be searched for in which is the drupal install base path  ', 0),
(111, 'help', ' how views handlers work in views a handler is an object that is part of the view and is part of the query building flow handlers are objects much of the time the base handlers will work but often you ll need to override the handler for something one typical handler override will be viewshandlerfilteroperatorin which allows you to have a filter select from a list of options you ll need to override this to provide your list handlers have two distint code flows the ui flow and the view building flow for the query flow handler construct create the initial handler at this time it is not yet attached to a view it is here that you can set basic defaults if needed but there will be no knowledge of the environment yet handler setdefinition set the data from hookviewsdata relevant to the handler handler init attach the handler to a view and usually provides the options from the display handler prequery run prior to the query stage to do early processing handler query do the bulk of the work this handler needs to do to add itself to the query fields being the only handlers concerned with output also have an extended piece of the flow handler prerender called prior to the actual rendering this allows handlers to query for extra data the entire resultset is available here and this is where items that have multiple values per record can do their extra query for all of the records available there are several examples of this at work in the code handler render this does the actual work of rendering the field most handlers are just extensions of existing classes with a few tweaks that are specific to the field in question for example filter by node type class viewshandlerfilternodetype extends viewshandlerfilterinoperator function getvalueoptions if isset this valueoptions this valuetitle t node type types nodegettypes foreach types as type info options type info name this valueoptions options  viewshandlerfilterinoperator provides a simple mechanism to set the list used and the rest of the handler is perfectly fine for this handlers are stored in their own files for these files to be loaded by views on demand they must first be registered since views core handlers are also loaded this way it s imperative that your module also implement this pattern in order to prevent code crashes when your handler s parent class is not yet available to register handlers you must implement hookviewshandlers   this hook returns an array with two keys the first key is info which contains the modulename which is only necessary if you re registering handlers on behalf of another module such as what views does and path  which is the search path to find the files this path is only necessary if your files will not be stored in the same directory as the module file the other key is handlers which contains a full array of handlers and the information for each handler the key to each handler array is the name of the handler class it can contain  parent the class that this handler extends this is important to make sure that the parent class is included before your handler class without this you may cause people s sites to crash in a difficult to recover state be sure you get this right  file the filename the handler is in by default this will be classnameinc however you can have multiple similar handlers together in one file however because there is only one parent please be sure that the parentage on these handlers matches otherwise you will run into whitescreens as not all parents will be loaded you can see examples of this function in any of the various moduleviewsinc files in the views modules directory the best place to learn more about handlers and how they work is to explore the views api site and use existing handlers as a guide and a model understanding how viewshandler and its child classes work is handy but you can do a lot just following these models you can also explore the views module directory particularly nodeviewsinc please note that while all handler names in views are prefixed with views you should use your own module s name to prefix your handler names in order to ensure namespace safety note that the basic pattern for handler naming goes like this module handler type tablename fieldname sometimes table and fieldname are not appropriate but something that resembles what the table field would be can be used ', 0),
(112, 'help', ' how views plugins work in views a plugin is a bit like a handler but plugins are not directly responsible for building the query instead they are objects that are used to display the view or make other modifications there are 6 types of plugins in views display display plugins are responsible for controlling where a view lives page and block are the most common displays as well as the ubiquitous default display which is likely what will be embedded style style plugins control how a view is displayed for the most part they are object wrappers around theme templates row style row styles handle each individual record from a node argument default argument default plugins allow pluggable ways of providing arguments for blocks views includes plugins to extract node and user ids from the url additional plugins could be used for a wide variety of tasks argument validator validator plugins can ensure arguments are valid and even do transformations on the arguments access access plugins are responsible for controlling access to the view plugins are registered by implementing hookviewsplugins  in your modulenameviewsinc file and returning an array of data the array will look something like this return array display array list of display plugins style array list of style plugins row array list of row style plugins argument default array list of argument default plugins argument validator array list of argument validator plugins access array list of access plugins each plugin will be registered with an identifier for the plugin plus a fairly lengthy list of items that can define how and where the plugin is used here is an example from views core node array title t node help t display the node with standard node view handler viewspluginrownodeview path drupalgetpath module views modules node not necessary for most modules theme viewsviewrownode base array node only works with node as base uses options true type normal of particular interest is the path directive which works a little differently from handler registration each plugin must define its own path rather than relying on a global info for the paths also there is an optional parent directive which is automatically filled in to be the base parent for the plugin type usually this is enough but if your plugin derives from something other than the base it must be filled in for example feed array title t feed help t display the view as a feed such as an rss feed handler viewsplugindisplayfeed parent page so it knows to load the page plugin inc file uses hook menu true use ajax false use pager false accept attachments false admin t feed help topic displayfeed note that unlike handler registration where parentage is referred to by object name with plugins it is referred to by the unique plugin identifier please be sure to prefix your plugin identifiers with your module name to ensure namespace safety after all two different modules could try to implement the grid2 plugin and that would cause one plugin to completely fail todo finish this document  ', 0),
(113, 'help', ' integrating the node example module for the new table defined by the node example module to be understood by the views module you need to create a nodeexampleviewsinc file that describes the table and its relationships to the rest of the database in order for views to know that this file is to be loaded you need to implement hookviewsapi this is done by adding the following function into your nodeexamplemodule file php implementation of hookviewsapi this tells drupal that there is views integration file named modulenameviewsinc function nodeexampleviewsapi note that you can include path in this array so that your viewsinc file can be stored in a different location return array api 20 below is the contents of a simple nodeexampleviewsinc file that allows you to create views that include the new color and quantity information php id apiexamplehtml v 12 20090915 154414 merlinofchaos exp this file is used to tell the views module about the new nodeexample table database definition code create table nodeexample vid int 10 unsigned not null default 0 nid int 10 unsigned not null default 0 color varchar 255 not null default quantity int 10 unsigned not null default 0 primary key vid nid key nodeexamplenid nid endcode function nodeexampleviewsdata basic table information nodeexample table new group within views called example the group will appear in the ui in the dropdown tha allows you to narrow down which fields and filters are available data array data nodeexample table group t example let views know that our example table joins to the node base table this means it will be available when listing nodes and automatically make its fields appear we also show up for node revisions data nodeexample table join array noderevisions array leftfield vid field vid node array leftfield vid field vid quantity data nodeexample quantity array title t quantity help t quantity of items field array handler viewshandlerfieldnumeric click sortable true filter array handler viewshandlerfilternumeric sort array handler viewshandlersort color data nodeexample color array title t color help t color of item field array handler viewshandlerfield click sortable true filter array handler viewshandlerfilterstring argument array handler viewshandlerargumentstring sort array handler viewshandlersort return data some notes on usage within views click on the add tab you have a number of type options here normally you would select either node if you only want to display information on current nodes or node revision if you want to display information on all revisions of the nodes with this configuration you always pull out of the database data for every single node whether or not it has color and quantity information to display information on just those nodes that have color and quantity information you can use a filter so that only nodes which don t have a null color or a null quantity are displayed type relationship extension when your tables have first class data you will often need to have own view types and view relationships defined with the current nodeexample table this isn t required although i try to justify it below on an efficiency basis see http groupsdrupalorg node 17236 comment58980 this discussion as to why it isn t justified pulling data out of the database for every node when you only want data for the new example node type is inefficient to reduce the initial data extraction to just that relating to the new example nodes requires that you make the nodeexample table the base table this can be done by adding the following code into the nodeexampleviewsinc file just before the return data php begin optional extra for type and relationships use nodeexample as a new base table by creating a new views type called node example this allows it to be selected as the view type when you initially add a new view data nodeexample table base array field vid title t node example help t node example type with color and quantity information weight 9 when using the new node example type you need to use relationships to access fields in other tables relationship to the node revision table data nodeexample vid array title t node revision help t the particular node revision the color and quantity is attached to relationship array label t node revision base noderevisions base field vid this allows us to not show this relationship if the base is already noderevisions so users won t create circular relationships skip base array node noderevisions relationship to the node table data nodeexample nid array title t node help t the particular node the color and quantity is attached to relationship array label t node base node base field nid this allows us to not show this relationship if the base is already node so users won t create circular relationships skip base array node noderevisions end optional extra for type and relationships the above code adds a new node example to the view types that can be selected within the add tab window of views selecting this sets the nodeexample table to be the base table if you select node example as view type when you initially go into the edit window of views you will find the only fields available are the color and quantity fields to get fields from other tables you need to add a relationship relationships may be found at the top in the same column as the fields  ', 0),
(114, 'help', ' readme readmetxt a module containing helper functions for drupal developers and inquisitive admins this module can print a log of all database queries for each page request at the bottom of each page the summary includes how many times each query was executed on a page and how long each query took it also a block for running custom php on a page a block for quickly accessing devel pages a block for masquerading as other users useful for testing reports memory usage at bottom of page more this module is safe to use on a production site just be sure to only grant access development information permission to developers also a dpr function is provided which pretty prints arrays and strings useful during development many other nice functions like dpm dvm ajax developers in particular ought to install firephp core from http wwwfirephporg and put it in the devel directory your path to fbphp should looks like devel firephpcore lib firephpcore fbphp you can use svn checkout http firephpgooglecodecom svn trunk trunk libraries firephpcore then you can log php variables to the firebug console is quite useful included in this package is also develthemermodule which outputs deep information related to all theme calls on a page develnodeaccess module which prints out the nodeaccess records for a given node also offers hooknodeaccessexplain for all node access modules to implement handy develgeneratemodule which bulk creates nodes users comment terms for development macro module has moved to http drupalorg project macro compatibility notes modules that use ahah may have incompatibility with the query log and other footer info consider setting globals develshutdown false in order to avoid issues modules that use ajax should idenify their response as contenttype text javascript the easiest way to do that is run your reply through drupaljson author maintainer moshe weitzman weitzman at tejasa dot com  ', 0),
(115, 'help', ' readmedevelnodeaccess readme this module contains tools for developers using access control modules to restrict access to some nodes it is intended to help catch some common mistakes and provide feedback to confirm that restricted nodes are in fact visible only to the intended users provides a summary page which queries the nodeaccess table and reports common mistakes such as the presence of drupal s default entry which grants all users read access to all nodes also reports the presence of nodes not represented in nodeaccess table this may occur when an access control module is installed after nodes have already been created provides a block which shows all nodeaccess entries for the nodes shown on a given page this gives developers a quick check to see that grants are provided as they should be this block autoenables to the footer region you may move it as desired if you enable dba debug mode on the devel settings page you will get more information provides a second block that shows and explains the crud access rights of the 10 most recently active users this block is disabled by default because it has a huge overhead if views module is installed allows browsing of nodes by realm including those nodes not in the nodeaccess table null realm wishlist things i d like to see but haven t had time to do automatically solve common problems ie delete the all realm entry and automatically save all nodes not in the nodeaccess table nicer feedback indicating whether nodes are visible to the public or not ie use color coding or icons summary does not differentiate between view grants and other types of grants i personally use nodeaccess only for view grants so i m not sure exactly what else it should show staff original author dave cohen aka yogadex on drupalorg current maintainer hans salvisberg aka salvis on drupalorg  ', 0),
(116, 'help', ' readme  id readmetxt v 12 20080521 050445 webchick exp contents of this file introduction installation introduction authors jeff robbins jjeff angela byron webchick addison berry add1sun this module made by robots http wwwlullabotcom jquery update module upgrades drupal s stable version of jquery in order to support the most current jquery version available once a stable release of drupal comes out only minor bugfix changes may be added to it so drupal s version of jquery will often lag behind the most recent release offered by the jquery project the jquery community tends to only support the most recent version so this module ensures that your drupal installation can run the most uptodate jquery plugins installation 1 copy the jqueryupdate directory to your sites sitename modules directory 2 enable the module at administer site building modules 3 that s it thanks to the new theme system in drupal 6x you no longer need to copy files around hooray  ', 0),
