('gmap_node_map', 'a:4:{s:5:"macro";s:111:"[gmap zoom=11 |center=30.27330042806996,-97.74192810058594 |width=530px |height=350px |control=Small |type=Map]";s:6:"header";s:708:"This web tool is designed to create a list of Austin''s historic and cultural resources. Austin as many buildings, structures, and landscapes that connects us with the past and make the city a unique place to live and visit. Surveying these places is an important step in planning for the future.\r\n<br/><br/>\r\nYou are invited to browse the map below or search for historic properties. You will find information from the City of Austin''s official inventory of cultural resources and information about local, state, and national historic landmarks. You can also contribute to this survey and view data other registered users have contributed. We encourage you to learn more about how to help with this effort.\r\n";s:6:"footer";s:0:"";s:10:"markermode";s:1:"1";}'),
